(10, 1, 3, 'Turn this character 45 degrees either way, and you have the x used for the Roman numeral <b>ten</b>.', '十', '', 18, '2010-09-23 05:33:35', '2010-10-11 03:30:00', 18, 18),
(11, 1, 3, 'The kanji for <b>mouth</b> is a clear pictograph.  Since there are no circular shapes in kanji, the square must be used to depict the circle.', '口', '', 18, '2010-09-23 05:33:57', '2010-10-11 03:30:00', 18, 18),
(12, 1, 3, 'This kanji is intended to be a pictograph of the sun.  Recalling what we said previously about round forms, it is easy to detect the circle and the big smile that characterise our simplest drawings of the sun - like those yellow badges with the words, &quot;Have a nice <b>day</b>!&quot;', '日', '', 18, '2010-09-23 05:33:47', '2010-10-11 03:30:00', 18, 18),
(13, 1, 3, 'This charcter is a picture of the moon, with the two horizontal lines representing the left eye and mouth of the mythical &quot;man in the moon&quot;.  And one <b>month</b>, of course, is one cycle of the moon.', '月', '', 18, '2010-09-23 05:34:14', '2010-10-11 03:30:00', 18, 18),
(14, 1, 3, 'This kanji looks like a bird&#039;s-eye view of a <b>rice field</b> divided into four plots.', '田', '', 18, '2010-09-23 05:35:31', '2010-10-11 03:30:00', 18, 18),
(15, 1, 3, 'If we round the corners of this kanji, and curve the middle strokes, we get something resembling an <b>eye</b>.', '目', '', 18, '2010-09-23 05:35:19', '2010-10-11 03:30:00', 18, 18),
