(2128, 1, 411, 'とうきょうはえいがをみにいきます。', 'Jeg drar til Tokyo or &aring; se p&aring; en film.', '', 9, '2010-09-25 09:09:43', '2010-10-04 03:30:00', 9, 9),
(2129, 1, 411, 'スーさんはともだちのうちにべんきょうしにいきます。', 'Suu g&aring;r til et venn sitt hus for &aring; studere.', '', 9, '2010-09-25 09:05:17', '2010-10-04 03:30:00', 9, 9),
