(2133, 1, 414, 'でも、ときどきえいがをみます。', 'Men, av og til ser jeg filmer.', '', 10, '2010-09-20 05:30:45', '2010-09-30 03:30:00', 10, 10),
(2134, 1, 414, 'じゃあ、にちようびはどうですか。', 'Hva med s&oslash;ndag da?', '', 10, '2010-09-20 05:31:09', '2010-09-30 03:30:00', 10, 10),
(2135, 1, 414, 'いいですね。', 'Det g&aring;r greit.', '', 10, '2010-09-20 05:30:40', '2010-09-30 03:30:00', 10, 10),
