(2399, 1, 450, '二千八百円です。どうもありがとうございました。', 'Det blir 2.800 yen.  Tusen takk.', '', 8, '2010-09-21 15:50:47', '2010-09-29 03:30:00', 8, 8),
(2400, 1, 451, 'きれいでしたね。', 'Den var vakker!', '', 8, '2010-09-21 15:49:59', '2010-09-29 03:30:00', 8, 8),
