(4334, 1, 605, 'ねました', 'sov', '', 9, '2010-09-18 06:54:24', '2010-09-27 03:30:00', 9, 9),
(4335, 1, 605, 'はい、べんきょうしました。', 'Ja, hun studerte.', '', 9, '2010-09-18 06:57:36', '2010-09-27 03:30:00', 9, 9),
(4336, 1, 605, 'メアリーさんはもくようびににほんじんのともだちにあいましたか。', 'Traff Mary en japansk venn p&aring; torsdag?', '', 9, '2010-09-18 06:58:32', '2010-09-27 03:30:00', 9, 9),
(4337, 1, 605, 'よみました', 'leste', '', 9, '2010-09-18 06:59:00', '2010-09-27 03:30:00', 9, 9),
(4338, 1, 605, 'ありました', 'det var', '', 9, '2010-09-18 06:53:13', '2010-09-27 03:30:00', 9, 9),
(4339, 1, 605, 'メアリーさんはかようびになにをしましたか。', 'Hva gjort Mary p&aring; tirsdag?', '', 9, '2010-09-18 06:57:30', '2010-09-27 03:30:00', 9, 9),
(4340, 1, 605, 'いいえ、いきませんでした。', 'Nei, hun gikk ikke.', '', 9, '2010-09-18 06:50:31', '2010-09-27 03:30:00', 9, 9),
(4341, 1, 605, 'どようびにえいがをみました。', 'Hun s&aring;g filmen p&aring; l&oslash;rdag.', '', 9, '2010-09-18 06:54:47', '2010-09-27 03:30:00', 9, 9),
