(4439, 1, 473, 'こどものとき、いじわるでしたか。', 'N&aring;r du var et barn, var du &quot;mean-spirited&quot;', '', 8, '2010-09-24 16:14:55', '2010-10-02 03:30:00', 8, 8),
(4440, 1, 473, 'はい、いじわるでした。', 'Ja, jeg var &quot;mean-spirited&quot;', '', 8, '2010-09-24 16:00:23', '2010-10-02 03:30:00', 8, 8),
(4441, 1, 473, 'Bさんは、こどものときいじわるだったといっていました。', 'B sa at n&aring;r han var et barn, var han &quot;mean-spirited&quot;.', '', 8, '2010-09-24 16:14:34', '2010-10-02 03:30:00', 8, 8),
(4442, 1, 473, 'こどものとき、がっこうがすきでしたか。', 'N&aring;r du var et barn, likte du skole?', '', 8, '2010-09-24 16:09:56', '2010-10-02 03:30:00', 8, 8),
(4443, 1, 473, 'いいえ、すきじゃありませんでした', 'Nei, jeg likte det ikke.', '', 8, '2010-09-24 16:08:59', '2010-10-02 03:30:00', 8, 8),
(4444, 1, 473, 'Bさんは、こどものときがっこうがすきじゃなかったといっていました。', 'B sa at n&aring;r han var et barn, likte han ikke skole.', '', 8, '2010-09-24 16:06:24', '2010-10-02 03:30:00', 8, 8),
(4445, 1, 473, 'こどものとき、あたまがよかったですか。', 'N&aring;r du var et barn, var du klokk?', '', 8, '2010-09-24 16:06:41', '2010-10-02 03:30:00', 8, 8),
(4446, 1, 473, 'はい、よかったです。', 'Ja, jeg var klokk.', '', 8, '2010-09-24 16:03:05', '2010-10-02 03:30:00', 8, 8),
(4447, 1, 473, 'Bさんは、こどものときあたまがよかったといっていました。', 'B sa at n&aring;r han var et barn, var han klokk.', '', 8, '2010-09-24 16:13:12', '2010-10-02 03:30:00', 8, 8),
(4448, 1, 473, 'こどものとき、せがたかかったですか。', 'N&aring;r du var et barn, var du h&oslash;y?', '', 8, '2010-09-24 16:06:57', '2010-10-02 03:30:00', 8, 8),
(4449, 1, 473, 'いいえ、せがたかくありませんでした。', 'Nei, jeg var ikke h&oslash;y.', '', 8, '2010-09-24 16:11:38', '2010-10-02 03:30:00', 8, 8),
(4450, 1, 473, 'Bさんは、こどものときせがたかくなかったといっていました。', 'B sa at n&aring;r han var et barn, var han ikke h&oslash;y.', '', 8, '2010-09-24 16:01:10', '2010-10-02 03:30:00', 8, 8),
(4451, 1, 473, 'こどものとき、かわいかったですか。', 'N&aring;r du var et barn, var du s&oslash;t?', '', 8, '2010-09-24 16:11:10', '2010-10-02 03:30:00', 8, 8),
(4452, 1, 473, 'はい、かわいかったです。', 'Ja, jeg var s&oslash;t.', '', 8, '2010-09-24 16:12:51', '2010-10-02 03:30:00', 8, 8),
(4453, 1, 473, 'Bさんは、こどものときかわいかったといっていました。', 'B sa at n&aring;r han var et barn, var han s&oslash;t.', '', 8, '2010-09-24 16:05:11', '2010-10-02 03:30:00', 8, 8),
(4454, 1, 473, 'こどものとき、めがねをかけていましたか。', 'N&aring;r du var et barn, hadde du briller?', '', 8, '2010-09-24 16:07:48', '2010-10-02 03:30:00', 8, 8),
(4455, 1, 473, 'いいえ、かけていませんでした。', 'Nei, jeg hadde ikke briller.', '', 8, '2010-09-24 16:02:31', '2010-10-02 03:30:00', 8, 8),
(4456, 1, 473, 'Bさんは、こどものときめがねをかけていなかったといっていました。', 'B sa at n&aring;r han var et barn, hadde han ikke briller.', '', 8, '2010-09-24 16:10:35', '2010-10-02 03:30:00', 8, 8),
(4457, 1, 473, 'こどものとき、よくなにをしましたか。', 'N&aring;r du var et barn, hva gjorde du ofte?', '', 8, '2010-09-24 16:07:19', '2010-10-02 03:30:00', 8, 8),
(4458, 1, 473, 'よくほんをよみました。', 'Jeg leste ofte b&oslash;ker.', '', 8, '2010-09-24 16:02:51', '2010-10-02 03:30:00', 8, 8),
(4459, 1, 473, 'Bさんは、こどものときよくほんをよんだといっていました。', 'B sa at n&aring;r han var et barn, leste han ofte b&oslash;ker.', '', 8, '2010-09-24 16:01:53', '2010-10-02 03:30:00', 8, 8),
(4460, 1, 473, 'シュワルツェネッガーは、きのうたくさぬんどうしたといっていました。', 'Schwarzenegger sa at han trente i g&aring;r.', '', 8, '2010-09-24 16:11:56', '2010-10-02 03:30:00', 8, 8),
(4461, 1, 473, 'マイケル・ジャクソンは、こどものときおんがくがすきだったといっていました。', 'Michael Jackson sa at n&aring;r han var et barn, likte han musik.', '', 8, '2010-09-24 16:05:57', '2010-10-02 03:30:00', 8, 8),
(4462, 1, 473, 'エルビス・プレスリーは、若いときふとっていなかったといっていました。', 'Elvis Presely sa at n&aring;r han var ung, var han ikke overvektig.', '', 8, '2010-09-24 16:09:16', '2010-10-02 03:30:00', 8, 8),
(4463, 1, 473, 'ともだちは、せんげつちゅうごくにいったといっていました。', 'Vennen min sa at den forrige m&aring;naden reiste han til Kina.', '', 8, '2010-09-24 16:14:17', '2010-10-02 03:30:00', 8, 8),
(4464, 1, 473, 'ははは、こうこうのときぜんぜんべんきょうしなかったといっていました。', 'Mora mi sa at n&aring;r hun gikk p&aring; skole, studerte hun ikke i de heile tatt.', '', 8, '2010-09-24 16:00:46', '2010-10-02 03:30:00', 8, 8),
(4465, 1, 473, 'にほんごのせんせいは、だいがくのときよくラーメンをたべたといっていました。', 'Japansk l&aelig;reren min sa at n&aring;r han gikk p&aring; universitet, spiste han ofte ramen.', '', 8, '2010-09-24 16:04:53', '2010-10-02 03:30:00', 8, 8),
(4466, 1, 4, 'The primitive elements that compose this character are <i>ten</i> and <i>mouth</i>, but you may find it easier to remember it as a pictograph of a tombstone with a cross on top.  Just think back to one of those graveyards you use to play in as a child, with <b>old</b> inscriptions on the tombstones.', '古', '', 18, '2010-09-24 19:17:56', '2010-10-12 03:30:00', 18, 18),
(4467, 1, 4, 'The key word here should be taken in the sense of the &quot;perceiving subject&quot;.  Now the one place in our bodies that all <i>five</i> senses are concentrated in is the head, which has no less than <i>five mouths</i>: 2 nostrils, 2 ears, and 1 mouth.  Hence, <i>five mouths</i> = <b>I</b>.', '吾', '', 18, '2010-09-24 19:17:24', '2010-10-12 03:30:00', 18, 18),
(4468, 1, 4, 'Remember when you were young and your mother told you never to look directly into the <i>sun</i> for fear you might burn out your <i>eyes</i>?  Probably you were foolish enough to <b>risk</b> a quick glance once or twice.  Here, too, the kanji that has a <i>sun</i> above and an <i>eye</i> right below looking up has the meaning of <b>risk</b>', '冒', '', 18, '2010-09-24 19:18:40', '2010-10-12 03:30:00', 18, 18),
(4469, 1, 4, 'The first <b>companion</b> that God made, as the Bible story goes, was Eve.  Upon seeing her, Adam exclaimed, &quot;<i>Flesh</i> of my <i>flesh!</i>&quot; And that is precisely what this kanji says in so many strokes.', '朋', '', 18, '2010-09-24 19:17:01', '2010-10-12 03:30:00', 18, 18),
(4470, 1, 4, 'Among nature&#039;s <b>bright</b> lights, there are two that the biblical myth has God set in the sky: the <i>sun</i> to rule over the day and the <i>moon</i> to rule the night.  Each of them has come to represent one of the common connotations of this key word: the <i>sun</i>, the <b>bright</b> insight of the clear thinker, and the <i>moon</i>, the <b>bright</b> intuition of the poet and seer.', '明', '', 18, '2010-09-24 19:19:04', '2010-10-12 03:30:00', 18, 18),
(4471, 1, 4, 'This one is easy!  You have one <i>mouth</i> making no noise (the choirmaster) and two <i>mouths with wagging tongues</i> (the minimum for a chorus).  So think of the keyword, <b>chant</b>, as monastery singing, and the kanji is yours forever.', '唱', '', 18, '2010-09-24 19:16:36', '2010-10-12 03:30:00', 18, 18),
(4472, 1, 4, 'What else can the word <b>sparkle</b> suggest if not a diamond?  And if you&#039;ve ever held a diamond up to the light, you will have noticed how every facet becomes like a miniature <i>sun</i>.  This kanji is a picture of a tiny <i>sun</i> in three places (that is, &quot;everywhere&quot;), to give the sense of something that <b>sparkles</b> on all sides.', '晶', '', 18, '2010-09-24 19:16:15', '2010-10-12 03:30:00', 18, 18),
(4473, 1, 4, 'As in the character for sparkle, the triplication of a single element in this character indicates &quot;everywhere&quot; or &quot;heaps of&quot;.  When we think of <b>goods</b> in modern industrial society, we think of what has been mass-produced - that is to say, produced for the &quot;masses&quot; of open <i>mouths</i> waiting like fledglings in a nest to &quot;consume&quot; whatever comes their way.', '品', '', 18, '2010-09-24 19:20:06', '2010-10-12 03:30:00', 18, 18),
(4474, 1, 4, 'This character is rather like a picture of two vertebrae in the <b>spine</b> linked by a single stroke.', '呂', '', 18, '2010-09-24 19:20:29', '2010-10-12 03:30:00', 18, 18),
(4475, 1, 4, 'In this kanji we see <i>two suns</i>, one atop the other.  We speak of <b>prosperous</b> times as <i>sunny</i>, what could be more <b>prosperous</b> than a sky with <i>two suns</i>?', '昌', '', 18, '2010-09-24 19:18:17', '2010-10-12 03:30:00', 18, 18),
(4476, 1, 4, 'This kanji is actually a picture of the first flower of the day, which we shallcall the &lt;i&gt;sun&lt;/i&gt;-flower, since it begins with the element for &lt;i&gt;sun&lt;/i&gt;, and is held up on a stem with leaves.  This time, we shall ignore the pictograph and think of &lt;i&gt;sun&lt;/i&gt;flowers with &lt;i&gt;needles&lt;/i&gt; for stems.  The sense of &lt;b&gt;early&lt;/b&gt; is easily remembered, since the &lt;i&gt;sun&lt;/i&gt;flower is the early riser in the garden, since the &lt;i&gt;sun&lt;/i&gt; shines on it before all others.', '早', '', 18, '2010-09-25 10:48:54', '2010-10-13 03:30:00', 18, 18),
(4477, 1, 4, 'This character is a sort of nickname for the Japanese flag with its well-known emblem of the <b>rising sun</b>.  If you can picture two seams running down the great red <i>sun</i>, and then imagine it sitting on a <i>baseball</i> bat for a flagpole, then you have a picture of how the sport has caught on in the Land of the <b>Rising Sun</b>.', '旭', '', 18, '2010-09-25 10:48:41', '2010-10-13 03:30:00', 18, 18),
(4478, 1, 4, 'We consider one <b>generation</b> as a period of thiry (or <i>ten</i> plus <i>ten</i> plus <i>ten</i>) years.  If you look at this kanji in it&#039;s completed form, you will see three <i>tens</i>.  When writing it, think of the lower horizontal lines as &quot;addition&quot; lines, written under the numbers to add them up.  Thus: <i>ten</i> &quot;plus&quot; <i>ten</i> &quot;plus&quot; <i>ten</i> = thrity, one <b>generation</b>.', '世', '', 18, '2010-09-25 10:48:15', '2010-10-13 03:30:00', 18, 18),
(4479, 1, 4, 'The special meaning of the two primitives that make up this character are: <i>flesh (part of the body)</i> and <i>brain</i>.  What the kanji says is that the <i>part of the body</i> that keeps the <i>brain</i> in working order is the <b>stomach</b>.  To keep the elements in proper order, think of the <i>brain</i> as being &quot;held up&quot; by the <i>flesh</i>.', '胃', '', 18, '2010-09-25 10:47:54', '2010-10-13 03:30:00', 18, 18),
(4480, 1, 4, 'The Japanese commonly refer to the start of the day as the &quot;opening up of night&quot; into day.  Hence the keyword <b>nightbreak</b>.  The stroke at the bottom represents the <i>floor</i> or horizon over which the <i>sun</i> is poking its head.', '旦', '', 18, '2010-09-25 10:49:16', '2010-10-13 03:30:00', 18, 18),
(4481, 1, 4, 'On the left, a <i>part of the body</i>, on the right, the character for <i>nightbreak</i>.  What all this has to do with the <b>gall bladder</b> is not immediately clear.  But all we need to do is think of the proverb &quot;don&#039;t let the sun set on your anger&quot; (which ancient medicine said was caused by the bile the <b>gall blader</b> filtered out), and change it to &quot;don&#039;t let the <i>night break</i> on your anger&quot; (or your <b>gall</b>).', '胆', '', 18, '2010-09-25 10:49:08', '2010-10-13 03:30:00', 18, 18),
(4482, 1, 4, '&quot;Sunrise, sunset, sunrise, sunset...&quot; goes the song of the Fiddler on the Roof.  You can almost see the journey of the <i>sun</i> as it moves from one horizon (the <i>floor</i>) to its noonday heights in the sky overhead (the <i>ceiling</i>) and then disappears over the other horizon, day after day, marking the <b>span</b> of our lives.', '亘', '', 18, '2010-09-25 10:48:26', '2010-10-13 03:30:00', 18, 18),
(4483, 1, 4, 'You couldn&#039;t have asked for a better keyword for this kanji!  Just take a look at it: a perfect image of a <b>concave</b> lense, complete with its own little &quot;cave&quot;.', '凹', '', 18, '2010-09-25 10:47:41', '2010-10-13 03:30:00', 18, 18),
(4484, 1, 4, 'This kanji will help you see how the Japanese have no trouble keeping <b>convex</b> distinct from concave.', '凸', '', 18, '2010-09-25 10:48:34', '2010-10-13 03:30:00', 18, 18),
(4485, 1, 625, 'A <i>walking stick</i> is needed for <i>days</i> of <b>olden times</b>, since <i>days</i>, too, get old - at least in-so-far as we refer to them as the &quot;good old days&quot;.  The main thing is to think of &quot;good old days&quot; when you hear the keyword <b>olden times</b>.  The rest will take care of itself.', '旧', '', 17, '2010-09-09 22:00:31', '2010-09-26 03:30:00', 17, 17),
(4486, 1, 625, 'You can think of this kanji as a stylized picture of the nose, that little <i>drop</i> that Mother Nature set between your <i>eyes</i>.  The Japanese refer to themselves by pointing a finger at their nose - giving us an easy way to remember the kanji for <b>oneself</b>.', '自', '', 17, '2010-09-09 22:00:16', '2010-09-26 03:30:00', 17, 17),
(4487, 1, 625, 'The color <b>white</b> is a mixture of all the primary colors, both for pigments and for light, as we see when a prism breaks up the rays of the <i>sun</i>.  Hence a single <i>drop</i> of <i>sun</i> spells <b>white</b>.', '白', '', 17, '2010-09-09 22:00:24', '2010-09-26 03:30:00', 17, 17),
(4488, 1, 625, 'The Japanese refer to a person&#039;s 99th birthday as a &quot;<i>white</i> year&quot; becuase <i>white</i> is what you&#039;re left with if you subtract <i>one</i> from a <b>hundred</b>.', '百', '', 17, '2010-09-09 22:00:38', '2010-09-26 03:30:00', 17, 17),
(4489, 1, 625, 'The elements we have here are a <i>walking stick</i> and a <i>mouth</i>.  Remember the trouble your mother had getting medicine <b>in</b> your <i>mouth</i>?  Chances are it crossed her mind more than once to grab something handy, like your grandfather&#039;s <i>walking stick</i> to pry open your jaws while she performed her duty.  Keep the image of getting something <b>in</b> from the outside, and the abstract sense of this keyword should be a lot easier to remember.', '中', '', 17, '2010-09-09 22:00:45', '2010-09-26 03:30:00', 17, 17),
(4490, 1, 625, 'This kanjis is almost too simple to pull apart, but have a look at the <i>drop</i> above and the <i>ten</i> below.  Now put the elements together by thinking of squeezing two more zeros out of an <i>dropper</i> alongside the number <i>ten</i> to make it a <b>thousand</b>.', '千', '', 17, '2010-09-09 22:00:59', '2010-09-26 03:30:00', 17, 17),
(4491, 1, 625, 'The primitive for <i>mouth</i> and the character for <i>thousand</i> naturally form the idea of <b>tongue</b> if one thinks of a <i>thousand mouths</i> able to speak the same language, or as we say &quot;sharing a common <b>tongue</b>&quot;.  It is easy to see the connection between the idiom and the kanji if you take its image literally: a single <b>tongue</b> being passed around from <i>mouth</i> to <i>mouth</i>.', '舌', '', 17, '2010-09-09 22:01:10', '2010-09-26 03:30:00', 17, 17),
(4492, 1, 625, 'This is the character for the little wooden box that the Japanese use for measuring things, as well as for drinking sak&eacute; out of.  Simply imagine the outside as spiked with a <i>thousand</i> sharp <i>needles</i> and the quaint little <b>measuring box</b> becomes a drinkers nightmare!', '升', '', 17, '2010-09-09 22:00:52', '2010-09-26 03:30:00', 17, 17),
(4493, 1, 625, 'Our image here is made up of two primitive elements a <i>sun</i> and a <i>measuring box</i>.  Just as the <i>sun</i> can be seen <b>rising up</b> in the morning from - where else - the Land of the Rising Sun, this kanji has the <i>sun</i> <b>rising up</b> out of a Japanese <i>measuring box</i> - the &quot;<i>measuring box</i> of the <b>rising up</b> <i>sun</i>&quot;.', '昇', '', 17, '2010-09-12 17:56:03', '2010-09-29 03:30:00', 20, 19),
(4494, 1, 625, 'We speak of &quot;<b>round</b> numbers&quot; or &quot;<b>rounding</b> a number off&quot;, meaning to add an insignificant amount to bring it to the nearest 10.  For instance, if you add just the tiniest <i>drop</i> to <i>nine</i>, you end up with a <b>round</b> number.', '丸', '', 17, '2010-09-10 18:25:26', '2010-09-27 03:30:00', 17, 17),
(4495, 1, 625, 'This kanji actually stood for a small <b>measurement</b> used prior to the metric system, a bit over an inch in length, and from there acquired the sense of <b>measurement</b>.  In the old system, it was one-<i>tenth</i> of a shaku.  The kanji represents one <i>drop</i> of a <i>ten</i> (with a hook!)', '寸', '', 17, '2010-09-10 18:26:13', '2010-09-27 03:30:00', 17, 17),
(4496, 1, 625, '<i>Ten...rice fields...glue</i>.  That is how one would read the primitive elements of this kanji from top to bottom.  Now, if we make a simple sentence out of these elements, we get: &quot;<i>Ten rice fields glued</i> together&quot;. A <b>speciality</b>, of course, refers to one&#039;s special <i>field</i> of endeavour or competence.  In fact, few people remain content with a single <b>speciality</b> and usually extend themselves in other <i>fields</i> as well.  This is how we come to get the picture of <i>ten fields glued</i> together to represent a <b>speciality</b>.', '専', '', 17, '2010-09-10 18:25:56', '2010-09-27 03:30:00', 17, 17),
(4497, 1, 625, 'At the left we have the <i>needle</i>; at the right, the kanji for <i>specialty</i>, plus an extra <i>drop</i> at the top.  Think of a <b>Dr.</b> who is a <i>specialist</i> with a <i>needle</i> and let the <i>drop</i> at the top represent the period at the end of <b>Dr.</b>.', '博', '', 17, '2010-09-10 18:25:36', '2010-09-27 03:30:00', 17, 17),
(4498, 1, 625, 'This kanji is a real joy of simplicity: a <i>diving rod</i> with a <i>mouth</i> - which translate directly into <b>fortune-telling</b>.', '占', '', 17, '2010-09-10 18:26:41', '2010-09-27 03:30:00', 17, 17),
(4499, 1, 625, 'The two directions, <b>above</b> and below, are usually pointed at with the finger.  But the characters do not follow that custom, so we have to choose something else, easily remembered.  The primitives show a <i>magic wand</i> standing <b>above</b> a <i>floor</i> - &quot;magically&quot;, you might say!', '上', '', 17, '2010-09-10 18:26:06', '2010-09-27 03:30:00', 17, 17),
(4500, 1, 625, 'Here we see our famous <i>magic wand</i> hanging, all on its own, <b>below</b> the <i>ceiling</i>, as you probably already guessed would happen!', '下', '', 17, '2010-09-10 18:25:46', '2010-09-27 03:30:00', 17, 17),
(4501, 1, 625, 'The word <b>eminent</b> suggests a famous or well-known person.  So all you need to do - given the primitives of <i>magic wand</i> and <i>sunflower</i> - is to think of the world&#039;s most <b>eminent</b> magician as one who uses a <i>sunflower</i> for a <i>magic wand</i>.', '卓', '', 17, '2010-09-10 18:27:06', '2010-09-27 03:30:00', 17, 17),
(4502, 1, 625, 'On the right, we see the <i>moon</i> fading off into the first light of the <b>morning</b>, and to the left, the <i>mist</i> that falls to give nature a shower to prepare it for the coming heat.  If you can think of the <i>moon</i> tilting over to spill <i>mist</i> on your garden, you should have no trouble remembering the two primitives of this kanji.', '朝', '', 17, '2010-09-10 18:26:55', '2010-09-27 03:30:00', 16, 16),
(4503, 1, 645, 'When we run across abstract keywords like this one, the best way to get an image is to recall some common phrase in which the word appears.  For instance, we can think of the expression &quot;it&#039;s the <b>only</b> one of its kind&quot;.  Then we imagine a barker at a side-show advertising some strange pac-man like creature has inside his tent, with <b>only</b> a gigantic <i>mouth</i> and two wee <i>animal legs</i>.', '只', '', 17, '2010-09-11 12:57:32', '2010-09-28 03:30:00', 17, 17),
(4504, 1, 645, 'To remember the primitive elements that make up this kanji, an <i>eye</i> and <i>animal legs</i>, you might be tempted to think of it as a pictograph of a freakish <b>shellfish</b> with a single, gigantic <i>eye</i>, roaming the beaches on its slender little <i>legs</i>, scaring the wits out of sunbathers.', '貝', '', 17, '2010-09-11 12:57:28', '2010-09-28 03:30:00', 17, 17),
(4505, 1, 645, 'Now take <i>shellfish</i> and set a <i>magic wand</i> over it, and you have the kanji for <b>upright</b>.  After all, <i>shellfish</i> are incapable of walking <b>upright</b>.  It would take a magician with his <i>wand</i> to pull of such a feat!', '貞', '', 17, '2010-09-11 12:57:52', '2010-09-28 03:30:00', 17, 17),
(4506, 1, 645, 'How do we get <i>mouth</i> over <i>shellfish</i> to mean <b>employee</b>?  Just remember that the advice new <b>employees</b> get about keeping their <i>mouths</i> shut and doing theirjob, and then make that more graphic by picturing an office building full of white-collar workers scurrying around with <i>clams</i> pinched to their <i>mouths</i>!', '員', '', 17, '2010-09-11 12:57:01', '2010-09-28 03:30:00', 17, 17),
(4507, 1, 645, 'The elements that compose the character for <b>see</b> are an <i>eye</i>, firmly fixed to a pair of <i>human legs</i>.', '見', '', 17, '2010-09-11 12:57:22', '2010-09-28 03:30:00', 17, 17),
(4508, 1, 645, 'The top part of the kanji is the character for <i>olden times</i>.  Western mythological imagination has old &quot;Father Time&quot; leaning on his sickle with a <b>newborn babe</b> crawling around his <i>human legs</i>.  The idea being that the circle of birth-and-death goes on.', '児', '', 17, '2010-09-11 12:57:40', '2010-09-28 03:30:00', 17, 17),
(4509, 1, 645, '&quot;In the <b>beginning</b>...&quot; starts that marvelous shelf of books we call the Bible.  It talks about how all things were made, and tells us that when the Creator came to humanity she made to of them: man and woman.  Hence, we need <i>two</i> and a pair of <i>human legs</i> to come to the kanji that means <b>beginning</b>.', '元', '', 17, '2010-09-11 12:57:15', '2010-09-28 03:30:00', 17, 17),
(4510, 1, 645, 'What we have to do here i turn a <i>shellfish</i> into a <b>page</b> of a book.  The <i>one</i> at the top tells us that we only get a rather short book, in fact a book of only <i>one</i> page.  Imagine a title printed on the shell of an <i>oyster</i>, and open the book to its <i>one</i> and only <b>page</b>, on which you find a <i>drop</i> of wisdom, one of the masterpiece poems of nature.', '頁', '', 17, '2010-09-11 12:57:09', '2010-09-28 03:30:00', 17, 17),
(4511, 1, 645, 'This character refers to the block<i>headed</i>, persistent, <b>stubborn</b>-ness of one who sticks to an idea or a plan just the way it was at the <i>beginning</i>.  The root of all <b>stubborn</b>-ness goes back to the <i>beginning</i> with two brothers <b>stubbornly</b> defending his own way of life and asking God to bless it favourably.  Picture these two with their giant, swelled, <i>heads</i>, each vying for the favours of heaven, a <b>stubborn</b> grimace on their faces.', '頑', '', 10, '2010-09-19 08:36:12', '2010-09-29 03:30:00', 33, 30),
(4512, 1, 645, 'While we refer to something insignificant as a <i>drop</i> in the bucket, the kanji for <b>mediocre</b> suggests a <i>drop</i> in the <i>wind</i>.', '凡', '', 17, '2010-09-12 17:59:14', '2010-09-29 03:30:00', 17, 17),
(4513, 1, 645, 'Above we have the condensed form of <i>bound up</i>, and below the familiar <i>shellfish</i>.  Imagine two <i>oysters</i> engaged in <i>shell-to-shell</i> combat, the one who is <b>defeated</b> being <i>bound and gagged</i> with seaweed, the victor towering triumphantly over it.  The <i>bound shellfish</i> thus has become the symbol for <b>defeat</b>.', '負', '', 17, '2010-09-12 17:58:49', '2010-09-29 03:30:00', 17, 17),
(4514, 1, 645, 'The comma is used to <i>bind up</i> a numerical units of <b>ten thousand</b> in japanese, the elements for <i>one</i> and <i>bound up</i> naturally come to form <b>ten thousand</b>.', '万', '', 17, '2010-09-12 17:56:55', '2010-09-29 03:30:00', 17, 17),
(4515, 1, 645, 'By combining the two primitives <i>bound up</i> and <i>mouth</i>, it is easy to see how this character can get the meaning of a <b>phrase</b>.  After all, a <b>phrase</b> is nothin more than a number of words <i>bound up</i> tightly and neatly so that they will fit in your <i>mouth</i>.', '句', '', 17, '2010-09-12 17:59:00', '2010-09-29 03:30:00', 17, 17),
(4516, 1, 645, 'Ever notice how the &lt;b&gt;texture&lt;/b&gt; of your face and hands is affected by the &lt;i&gt;wind&lt;/i&gt;?  A day&#039;s skiing or sailing makes them rough and dry, and in need of a good soft cream to soothe the burn.  So whenever a &lt;i&gt;part of the body&lt;/i&gt; gets exposed to the &lt;i&gt;wind&lt;/i&gt;, its texture is affected.', '肌', '', 17, '2010-09-13 20:18:57', '2010-09-30 03:30:00', 19, 18),
(4517, 1, 645, 'A <b>decameron</b> is a journey of ten <i>days</i> taken by a band of people - that is, a group fo people <i>bound together</i> for the <i>days</i> of the <b>decameron</b>.', '旬', '', 17, '2010-09-12 17:58:15', '2010-09-29 03:30:00', 17, 17),
(4518, 1, 645, 'If you want to <i>bind up</i> drops of something, you use something to scoop those <i>drops</i> up, which is what we call a <b>ladle</b>.  See the last <i>drop</i> left <i>bound up</i> in the <b>ladle</b>.', '勺', '', 17, '2010-09-12 17:56:32', '2010-09-29 03:30:00', 17, 17),
(4519, 1, 645, 'The elements <i>white bird</i> and <i>ladle</i> easily suggest the image of a <b>bull&#039;s eye</b> if oyu imagine a rusty old <i>ladle</i> with a <b>bull&#039;s eye</b> painted on it in the form of a tiny <i>white bird</i>, who lets out a little &quot;peep&quot; each time you hit the <b>bull&#039;s eye</b>.', '的', '', 17, '2010-09-12 17:57:17', '2010-09-29 03:30:00', 17, 17),
(4520, 1, 645, 'Reading this kanji from the top down we have: <i>horns...nose</i>.  Together they bring to mind the picture of a moose-head hanging on the wall, with its great <i>horns</i> and long <i>nose</i>.  Now while we would speak of cutting off the moose&#039;s &quot;head&quot; to hang it on the wall, the japanese speak of cutting of its <b>neck</b>.  If you let the word <b>neck</b> conjure up the image of a moose with a very l-o-n-g <b>neck</b> hangin over the fireplace, whose <i>horns</i> you use for a coat-rack and whose <i>nose</i> has spigots left and right for scotch and water, you have no trouble with the character.', '首', '', 17, '2010-09-19 08:35:55', '2010-10-06 03:30:00', 23, 21),
(4521, 1, 646, 'This kanji is a pictograph of a fishhook, it should not be hard to associate it with the keyword, <b>fish guts</b>.', '乙', '', 17, '2010-09-14 05:03:46', '2010-10-01 03:30:00', 17, 17),
(4522, 1, 646, 'In a <b>riot</b>, manners are laid aside and tempers get short, even in a courtesy-conscious land like Japan.  This kanji shows what happens to a <b>rioting</b> <i>tongue</i>: it gets &quot;barbed&quot; like a <i>fishhook</i> and sets to attacking the opposition, to <i>hook</i> them, as it were.', '乱', '', 17, '2010-09-14 05:03:24', '2010-10-01 03:30:00', 17, 17),
(4523, 1, 646, 'Begin with the two primitives: <i>needle</i> and <i>eye</i>.  Together they represent the <i>eye of a needle</i>.  Below them is a <i>fishhook</i> that has been <b>straightened out</b> and its barb removed so that it can pass through the <i>eye of a needle</i>, <b>straightaway</b>.', '直', '', 17, '2010-09-14 05:04:51', '2010-10-01 03:30:00', 17, 17),
(4524, 1, 646, 'Here is the full kanji on which the last frame is based.  If you can think of a table full of carpenter&#039;s <b>tools</b> of all sorts, each equipped with its own <i>eye</i> so that it can keep watch over what you are doing with it, you won&#039;t have trouble remembering this kanji.', '具', '', 17, '2010-09-14 05:03:38', '2010-10-01 03:30:00', 17, 17),
(4525, 1, 646, 'Here again we meet the composite element <i>eye of the needle</i> which here combines with <i>tool</i> to give us a measure of what is <b>true</b> and what is not.', '真', '', 17, '2010-09-14 05:04:28', '2010-10-01 03:30:00', 17, 17),
(4526, 1, 646, 'The pictograph of an I-beam, like the kind used in heavy construction work on buildings and bridges gives us the character for <b>craft</b> in general.', '工', '', 17, '2010-09-13 20:20:26', '2010-09-30 03:30:00', 17, 17),
(4527, 1, 646, 'By combining the primitive and the kanji for <i>by one&#039;s side</i> and <i>craft</i>, we get the kanji for<b>left</b>.  Conveniently, the <b>left</b> has traditionally been considered the siniseter <i>side</i>, where dark and occult <i>crafts</i> are cultivated.  The second stroke dropps down to the <b>left</b> and is longer than the first.', '左', '', 17, '2010-09-13 20:19:40', '2010-09-30 03:30:00', 17, 17),
(4528, 1, 646, 'When thinking of the keyword <b>right</b>, take of advantage of the double-meaning.  Imagine a little <i>mouth</i> hanging down by your <i>side</i> - like a little voice of conscience - telling you the <b>right</b> thing to do.  The second stroke should reach out to the <b>right</b> and is longer than the first.', '右', '', 17, '2010-09-13 20:20:36', '2010-09-30 03:30:00', 17, 17),
(4529, 1, 646, 'The picture here is of someone with a slab of <i>meat</i> dangling <i>by the side</i>, perhaps from a belt or rope tied around the waist.  Think of it as an evil spirit in <b>possession</b> of one&#039;s soul, who can be exorcised only by allowing fresh <i>meat</i> to hang <i>by one&#039;s side</i> until it begins to putrefy and stink so bad the demon departs.', '有', '', 17, '2010-09-13 20:19:55', '2010-09-30 03:30:00', 17, 17),
(4530, 1, 646, 'To the left we have the primitive for a <i>shellfish</i>, and to the right the kanji for <i>possess</i>.  Expand your view of <i>shells</i> to include the ancient value they had as money.  Now, one who lets <i>shells</i> <i>possess</i> them is liekly to abandon higher principles in order to acquire more wealth.  Such people are easiest to <b>bribe</b>.', '賄', '', 17, '2010-09-19 08:37:04', '2010-10-06 03:30:00', 21, 20),
(4531, 1, 646, 'A <b>tribute</b> in English is <i>money</i> collected by coercion.  Simply because a ruler bestows a noble name on a deed is hardly any consolation to the masses who must part with their hard-earned <i>money</i>.  Little wonder that this ancient <i>craft</i> of getting <i>money</i> by calling it <b>tribute</b> has given way to the name: tax.', '貢', '', 14, '2010-09-24 19:22:52', '2010-10-08 03:30:00', 27, 25),
(4532, 1, 646, 'To the right, we see a <i>head</i>; and to the left, the element that means <i>craft</i>.  When we think of a <b>paragraph</b>, we immediately think of a <i>heading</i> device to break a text into parts.  Just where and how to do it belongs to the writer&#039;s <i>craft</i>.  Hence, we define a <b>paragraph</b> as the <i>&quot;heading craft&quot;</i> to remember this character.', '項', '', 17, '2010-09-18 09:33:11', '2010-10-05 03:30:00', 24, 21),
(4533, 1, 623, 'さむくなりましたね。', 'Det blir kalt.', '', 8, '2010-09-24 16:27:45', '2010-10-02 03:30:00', 8, 8),
(4534, 1, 623, 'ええ。メアリーさん、ふゆやすみはどうしますか。', 'Ja.  Mary, hva gj&oslash;r du til vinterferie?', '', 8, '2010-09-24 16:29:35', '2010-10-02 03:30:00', 8, 8),
(4535, 1, 623, 'かんこくかたいわんにいくつもりですが、まだきめていません。', 'Jeg planlegger &aring; reise til Korea eller Taiwan, men jeg har ikke bestemt meg for det end&aring;.', '', 8, '2010-09-24 16:30:33', '2010-10-02 03:30:00', 8, 8),
(4536, 1, 623, 'いいですね。', 'S&aring; g&oslash;y.', '', 8, '2010-09-24 16:28:53', '2010-10-02 03:30:00', 8, 8),
(4537, 1, 623, 'かんこくとたいわんとどっちのほうがいいとおもいますか。', 'Hvilket synes du er bedre, Korea eller Taiwan?', '', 8, '2010-09-24 16:31:21', '2010-10-02 03:30:00', 8, 8),
(4538, 1, 623, 'うーん、たいわんのほうがあたたかいとおもいます。でも、スーさんはかんこくのたべものはおいしいといっていましたよ。', 'Hmm... Jeg synes det er varmere i Taiwan.  Men Suu sa at maten var deilig i Korea.', '', 8, '2010-09-24 16:28:40', '2010-10-02 03:30:00', 8, 8),
(4539, 1, 623, 'そうですね。ところで、たけしさんはどこかにいきますか。', 'Seier du det?  Forresten, reiser du til noeplass, Takeshi?', '', 8, '2010-09-24 16:27:32', '2010-10-02 03:30:00', 8, 8),
(4540, 1, 623, 'どこにもいきません。おかねがないから、ここにいます。', 'Jeg reiser ikke til noeplass.  Jeg har ikke penger, s&aring; blir jeg her.', '', 8, '2010-09-24 16:30:12', '2010-10-02 03:30:00', 8, 8),
(4541, 1, 623, 'そうですか。じゃあ、たけしさんいおみやげをかってきますよ。', 'Seier du det?  Da skal jeg kj&oslash;pe en s&oslash;venir til deg.', '', 8, '2010-09-24 16:30:59', '2010-10-02 03:30:00', 8, 8),
(4542, 1, 623, 'わあ、ありがとう。', 'Oi, takk!', '', 8, '2010-09-24 16:29:47', '2010-10-02 03:30:00', 8, 8),
(4543, 1, 624, 'おおさかからソウルまでひこうきのよゆくをおねがいします。', 'Jeg vil gjerne reservere et flybillett fra Osaka til Seoul.', '', 8, '2010-09-24 16:39:15', '2010-10-02 03:30:00', 8, 8),
(4544, 1, 624, 'はい、いつですか。', 'Ja, n&aring;r?', '', 8, '2010-09-24 16:39:51', '2010-10-02 03:30:00', 8, 8),
(4545, 1, 624, '十二月十九日です。', 'Til 19. desember.', '', 8, '2010-09-24 16:43:25', '2010-10-02 03:30:00', 8, 8);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(4546, 1, 624, 'ごぜんとごごのびんがありますが&hellip;', 'Vi har et fly om morgenen og et om ettermidagen.', '', 8, '2010-09-24 16:34:39', '2010-10-02 03:30:00', 8, 8),
(4547, 1, 624, 'ごぜんのをおねがいします。クレジットカードではらってもいいですか。', 'Dette om morgenen, takk.  Kan jeg bruke kort?', '', 8, '2010-09-24 16:34:53', '2010-10-02 03:30:00', 8, 8),
(4548, 1, 624, 'はい。', 'Ja.', '', 8, '2010-09-24 16:39:32', '2010-10-02 03:30:00', 8, 8),
(4549, 1, 624, 'ソウルまでどのぐらいかかりますか。', 'Hvor langt tid tar det til Seoul?', '', 8, '2010-09-24 16:41:16', '2010-10-02 03:30:00', 8, 8),
(4550, 1, 624, '一時間ぐらいです。', 'Sirka &eacute;n time.', '', 8, '2010-09-24 16:40:05', '2010-10-02 03:30:00', 8, 8),
(4551, 1, 646, 'Although this kanji no longer looks very much like a <b>sword</b>, is does have some resemblance to the handle of a <b>sword</b>.', '刀', '', 17, '2010-09-14 05:02:54', '2010-10-01 03:30:00', 17, 17),
(4552, 1, 646, 'Think of using a <i>dagger</i> as a razor <b>blade</b>, and it shhouldn&#039;t be hard to imagine cutting yourself.  See the little <i>drop of</i> blood, clinging to the <b>blade</b>?', '刃', '', 17, '2010-09-14 05:05:20', '2010-10-01 03:30:00', 17, 17),
(4553, 1, 646, 'To the right we see the <i>dagger</i> and next to it the number <i>seven</i>, meaning <i>diced</i>.  It is hard to think of <b>cutting</b> anything with a knife without imagining one of those skillful Japanese chefs.  Only let us say that he has had too much to drink at a party, grabs a <i>dagger</i> lying around and startc <i>dicing</i> up everything in sight, starting with the hors d&#039;oeuvres, and moving onto the furniture and carpets!', '切', '', 17, '2010-09-14 05:04:18', '2010-10-01 03:30:00', 17, 17),
(4554, 1, 646, 'A <i>dagger</i> posed over a <i>mouth</i> is how the character for &quot;beckoning&quot; is written.  The related but less tame keyword <b>seduce</b> was chosen because it seemed to fir better with the &quot;Freudian&quot; implications of the kanji: observe that it is unsure whether the long slender object is <b>seducing</b> the small round one or vice versa.', '召', '', 17, '2010-09-14 05:03:03', '2010-10-01 03:30:00', 17, 17),
(4555, 1, 646, 'Let the keyword suggest <b>shining</b> your shoes, the purpose of which is to <i>seduce</i> the <i>sun</i> down on them for all to see.', '昭', '', 17, '2010-09-17 05:04:41', '2010-10-04 03:30:00', 20, 19),
(4556, 1, 646, 'The character depicts a <i>clam</i> alongside a great and flashing <i>saber</i>.  Think of digging for <i>clams</i> in an area where there are <b>rules</b> governing how large a find has to be before you can keep it.  So, you take out your trusty <i>saber</i>, which you have carefully notched like a yardstick, and measure the poor wee beast to see if it is as long as the <b>rules</b> say it has to be.', '則', '', 17, '2010-09-14 05:02:40', '2010-10-01 03:30:00', 17, 17),
(4557, 1, 646, 'The keyword <b>vice-</b> is in the sense of someone second-in-command.  The great and flashing <i>saber</i> to the right and the <i>wealth</i> on the left combine to create an image of dividing one&#039;s property to give a share to one&#039;s <b>vice-</b><i>wealth-</i>holder.', '副', '', 17, '2010-09-14 05:05:12', '2010-10-01 03:30:00', 17, 17),
(4558, 1, 646, 'In the olde East, the samurai and his <i>saber</i> were never <b>seperated</b>; they were constant companions.  This kanji depicts what must have been the height of <b>seperation</b>-anxiety for the samurai: to be <i>bound up</i> with a rope, unable to get at his <i>saber</i> a few feet away from him.  Look at that <i>mouth</i> bellowing out for shame and sorrow!', '別', '', 17, '2010-09-14 05:04:03', '2010-10-01 03:30:00', 17, 17),
(4559, 1, 646, 'The picture here is of a <b>street</b> sign on a long pole: Hollywood and Vine, if you please!', '丁', '', 17, '2010-09-14 05:02:47', '2010-10-01 03:30:00', 17, 17),
(4560, 1, 646, '<i>Street</i> signs standing at the corner of the <i>rice fields</i> depict the <b>village</b> limits.', '町', '', 17, '2010-09-14 05:04:40', '2010-10-01 03:30:00', 17, 17),
(4561, 1, 646, 'Remember the story about the &quot;Little Engine that <b>Could</b>&quot;?  See the determined little locomotive huffing a puffing up the mountain, &quot;I think I <b>can</b>, I think I <b>can</b>...&quot; - spitting railroad <i>spikes</i> out of its <i>mouth</i> as it chews up the line to the top.', '可', '', 17, '2010-09-14 05:05:44', '2010-10-01 03:30:00', 17, 17),
(4562, 1, 646, 'The keyword is actually a formal metaphor meaning &quot;humble acceptance&quot;.  Reading off the two primitive elements in the order of writing, we have: <i>nail</i> and <i>head</i>.  As in &quot;hitting the <i>nail</i> on the <i>head</i>&quot;.  Now one presumes that most people can handle metaphors, but if you were to run itno a dimwit working in a hardware store who only know the literal meaning of things, and were to ask him, in your best Japanese, to <b>place on your head</b> a <i>nail</i>, he might miss the point and cause you considerable torment.', '頂', '', 16, '2010-09-13 20:20:10', '2010-09-29 03:30:00', 22, 21),
