(4612, 1, 656, 'AのはうがBより(adjektiv)。', 'A er mer (adjektiv) enn B', '', 8, '2010-09-25 10:05:22', '2010-10-03 03:30:00', 8, 8),
(4613, 1, 656, 'エルビス・プレスリーのほうがフランク・シナトラよりかっこいいです。', 'Elvis Presley er mer hip enn Frank Sinatra.', '', 8, '2010-09-25 10:05:14', '2010-10-03 03:30:00', 8, 8),
(4614, 1, 656, 'バーブラ・ストライザンドのほうがマドンナよりうたがじょうずです。', 'Barbra Streisand er en bedre sanger enn Madonna.', '', 8, '2010-09-25 10:05:11', '2010-10-03 03:30:00', 8, 8),
(4615, 1, 656, 'AとBとどっちのほうが(adjektiv)。', 'Av A og B, hvilken er mer (adjektiv)?', '', 8, '2010-09-25 10:04:24', '2010-10-03 03:30:00', 8, 8),
(4616, 1, 656, 'バスとでんしゃとどっちのほうがやすいですか。', 'Hvilken er billigst, bussen eller toget?', '', 8, '2010-09-25 10:04:29', '2010-10-03 03:30:00', 8, 8),
(4617, 1, 656, '[(disse)のなかで]Aがいちばん(adjektiv)', 'A er mest (adjektiv) [av (disse)]', '', 8, '2010-09-25 10:05:17', '2010-10-03 03:30:00', 8, 8),
(4618, 1, 656, 'パバロッティとカレーラスとドミンゴのなかで、だれがいちばんうたがじょうずだとおもいますか。', 'Av Pavarottis, Carreras, og Domingo, hvem synes du er den beste sangeren?', '', 8, '2010-09-25 10:04:50', '2010-10-03 03:30:00', 8, 8),
(4619, 1, 656, 'もちろん、パバロッティがいちばんうたがじょうずです。', 'Pavarotti er den beste, naturligvis.', '', 8, '2010-09-25 10:04:54', '2010-10-03 03:30:00', 8, 8),
(4620, 1, 657, 'わたしはくろいセーターをもっています。あかいのももっています。', 'Jeg har en svart genser.  Jeg har en r&oslash;d en &oacute;g.', '', 8, '2010-09-25 10:03:33', '2010-10-03 03:30:00', 8, 8),
(4621, 1, 657, 'やすいじしょうをかいにいきました。でもいいのがありませんでした。', 'Jeg gikk for &aring; kj&oslash;pe eni dyr ordbok, men de hadde ingen gode.', '', 8, '2010-09-25 10:03:25', '2010-10-03 03:30:00', 8, 8),
(4622, 1, 657, 'これはスーさんのかばんですか。', 'Er denne her Suu si veske?', '', 8, '2010-09-25 10:03:36', '2010-10-03 03:30:00', 8, 8),
(4623, 1, 657, 'いいえ、それはメアリーさんのです。', 'Nei, det er Mary si.', '', 8, '2010-09-25 10:03:10', '2010-10-03 03:30:00', 8, 8),
(4624, 1, 657, 'アメリカのアイスクリームのほうがにほんのよりおいしいです。', 'Amerikansk is er deiligere enn den Japanske.', '', 8, '2010-09-25 10:03:39', '2010-10-03 03:30:00', 8, 8),
(4625, 1, 658, 'verb (n&aring;tid, kort)+つもりだ', 'Jeg har tenkt &aring;...', '', 8, '2010-09-25 10:00:46', '2010-10-03 03:30:00', 8, 8),
(4626, 1, 658, 'しゅうまつにたけしさんとテニスをするつもりです。', 'Jeg har tenkt &aring; spille tennis med Takeshi denne helgen.', '', 8, '2010-09-25 10:01:09', '2010-10-03 03:30:00', 8, 8),
(4627, 1, 658, 'やましたせんせいはあしただいがくにこないつもりです。', 'Porf. Yamashita har ikke tenkt &aring; komme til universitet i morgen.', '', 8, '2010-09-25 10:01:07', '2010-10-03 03:30:00', 8, 8),
(4628, 1, 658, 'おてらをみにいくつもりでしたけど、てんきがよくなかったから、いきませんでした。', 'Vi hadde tenkt &aring; bes&oslash;ke et tempel, men we gjorde ikke det fordi v&aelig;ret var ikke bra.', '', 8, '2010-09-25 10:01:04', '2010-10-03 03:30:00', 8, 8),
(4629, 1, 659, 'あたたかい・あたたかくなる', 'varmt - &aring; bli varmere', '', 8, '2010-09-25 10:02:14', '2010-10-03 03:30:00', 8, 8),
(4630, 1, 659, 'しずかな・しずかになる', 'stilt - &aring; bli stillere', '', 8, '2010-09-25 10:02:02', '2010-10-03 03:30:00', 8, 8),
(4631, 1, 659, 'かいしゃいん・かいしゃいんになる', 'ansatte - &aring; bli ansatte', '', 8, '2010-09-25 10:02:16', '2010-10-03 03:30:00', 8, 8),
(4632, 1, 659, 'メアリーさんはまえよりにほんごがじょうずになりました。', 'Mary har blitt bedre p&aring; japansk enn f&oslash;r.', '', 8, '2010-09-25 10:02:11', '2010-10-03 03:30:00', 8, 8),
