(4639, 1, 660, 'どこかへいきましたか', 'Reiste du til et eller annet sted?', '', 8, '2010-09-25 10:09:27', '2010-10-03 03:30:00', 8, 8),
(4640, 1, 660, 'いいえ、どこへもいきませんでした。', 'Nei, jeg reiste til ingen steder.', '', 8, '2010-09-25 10:09:17', '2010-10-03 03:30:00', 8, 8),
(4641, 1, 660, 'だれかにあいましたか。', 'Traff du noen?', '', 8, '2010-09-25 10:08:44', '2010-10-03 03:30:00', 8, 8),
(4642, 1, 660, 'いいえ、だれにもあいませんでした。', 'Nei, jeg traff ingen.', '', 8, '2010-09-25 10:09:52', '2010-10-03 03:30:00', 8, 8),
(4643, 1, 660, 'なにかしましたか。', 'Gjorde du noe?', '', 8, '2010-09-25 10:09:57', '2010-10-03 03:30:00', 8, 8),
(4644, 1, 660, 'いいえ、なにもしませんでした。', 'Nei, jeg gjorde ingenting.', '', 8, '2010-09-25 10:09:46', '2010-10-03 03:30:00', 8, 8),
(4645, 1, 661, 'はしでごはんをたべます。', 'Vi spiste m&aring;lene v&aring;res med spisepinner.', '', 8, '2010-09-25 10:06:51', '2010-10-03 03:30:00', 8, 8),
(4646, 1, 661, 'にほんごではなしましょう。', 'La oss snakke p&aring; japansk.', '', 8, '2010-09-25 10:06:30', '2010-10-03 03:30:00', 8, 8),
(4647, 1, 661, 'バスでえきまでいみました。', 'Jeg tok bussen til stasjonen.', '', 8, '2010-09-25 10:06:41', '2010-10-03 03:30:00', 8, 8),
(4648, 1, 661, 'テレビでえいがをみました。', 'Jeg s&aring; en film p&aring; fjernsyn.', '', 8, '2010-09-25 10:06:45', '2010-10-03 03:30:00', 8, 8),
(4649, 1, 664, 'This kanji is a pictograph of a <b>child</b> wrapped up in one of those handy cocoons that Japanese mothers fix to their backs to carry their young <b>children</b> about.  The first stroke is a wee head popping out for air; the second shows the body and legs all wrapped up; and the final stroke shows the arms sticking out to cling to the mother&#039;s neck.', '子', '', 17, '2010-09-15 05:14:28', '2010-10-02 03:30:00', 17, 17),
(4650, 1, 664, 'Probably the onw thing most <i>children</i> fear more than anythings else is the dentist&#039;s chair.  Once a <i>child</i> has seen a dentist holding the x-rays up to the light and heard that ominous word <b>cavity</b>, it will not be long before those two syllables get associated with the row of shiny <i>hooks</i> the dentist uses to torture people who are too small to fight back.', '孔', '', 17, '2010-09-15 05:14:11', '2010-10-02 03:30:00', 17, 17),
(4651, 1, 664, 'The only difference between <b>complete</b> and the kanji for <i>child</i>, is that the &quot;arms&quot; have been left off (actually, they have been tucked inside).  Thus a <i>child</i> with its arms wrapped up into a back-sack is the picture of a job successfully <b>completed</b>.', '了', '', 17, '2010-09-15 05:14:47', '2010-10-02 03:30:00', 17, 17),
(4652, 1, 664, 'You have probably seen somewhere the form of a squating <b>woman</b> drawn behind this character.', '女', '', 17, '2010-09-15 05:15:03', '2010-10-02 03:30:00', 17, 17),
(4653, 1, 664, 'The phrase &quot;to be <b>fond</b> of someone&quot; has a natural gentleness about it, and lends a tenderness to the sense of touching by giving us the related term &quot;to <b>fondle</b>&quot;.  The character likens it to a <i>woman</i> <b>fondling</b> her <i>child</i>.', '好', '', 17, '2010-09-15 05:14:20', '2010-10-02 03:30:00', 17, 17),
(4654, 1, 664, 'Once upon a time, the <i>mouth</i> of a cave served as a ritual substitute for the opening through which a <i>woman</i> gives birth.  Hence, in order to be reborn as an adult, one may have to pass through something which bears a <b>likeness</b> to the <i>opening</i> of the <i>woman</i> from whom you were born.', '如', '', 13, '2010-09-23 05:36:44', '2010-10-06 03:30:00', 30, 28),
(4655, 1, 664, 'The kanji for <b>mama</b> contains the outline of the kanji for <i>woman</i>.  However, the second storke has been elongated to make space for two full breasts that make her a <b>mama</b>.', '母', '', 17, '2010-09-15 05:15:22', '2010-10-02 03:30:00', 17, 17),
(4656, 1, 664, 'Think of <b>piercing</b> your ears to put in a <i>mama</i>-of-pearl earing, you&#039;ve just snatched form an <i>oyster</i>.', '貫', '', 17, '2010-09-15 05:13:58', '2010-10-02 03:30:00', 17, 17),
(4657, 1, 664, 'The large <i>mouth</i> at the top and the <i>human legs</i> underneath almost jump off the page as a caricature of an <b>elder brother</b>, the one with the big <i>mouth</i>, who stomps around with his big <i>human legs</i> to get his way.', '兄', '', 17, '2010-09-15 05:14:36', '2010-10-02 03:30:00', 17, 17),
(4658, 1, 664, 'The kanji for <b>overcome</b> is composed of two elements: <i>needle</i> and <i>teenager</i>.  The <i>needle</i> is indicative of the problem of drugs, which faces many <i>teenagers</i> growing up today.  Many <i>teenagers</i> will fall under the shadow of the <i>needle</i>, but even a <i>teenager</i> is strong enough to <b>overcome</b> this habit.', '克', '', 17, '2010-09-15 05:14:58', '2010-10-02 03:30:00', 17, 17),
