(4679, 1, 675, 'The sense of <b>little</b> in this character is the same as &quot;small&quot; or &quot;tiny&quot;.  The image is of three <b>little</b> <i>drops</i>, the middle of which is written larger so that the kanji has some shape to it.  The point of writing it three times is to rub the point in: <b>little, little, little</b>.', '小', '', 17, '2010-09-16 05:15:12', '2010-10-03 03:30:00', 17, 17),
(4680, 1, 675, 'A <i>drop</i> of something <i>little</i> is very <b>few<b> drops indeed!', '少', '', 17, '2010-09-16 05:15:06', '2010-10-03 03:30:00', 17, 17),
(4681, 1, 675, 'Here we have a pictorgraph of a person.  Let&#039;s make him a fisherman, with his arms and legs streatched out to show how <b>large</b> a ctach he has cought.', '大', '', 17, '2010-09-16 05:16:19', '2010-10-03 03:30:00', 17, 17),
(4682, 1, 675, '&quot;<b>Many</b> <i>moons</i> ago&quot;, begins much of Amerindian folklore.  Here we have two <i>moons</i> (three would take us back to the beginning of time, which is further than the want to go), lacking a final stroke because they are partially hidden behind the <b>many</b> mists of time.', '多', '', 17, '2010-09-16 05:16:07', '2010-10-03 03:30:00', 17, 17),
(4683, 1, 675, 'Just as the word <b>evening</b> adds a touch of formality or romanticism to the ordinary word &quot;night&quot;, so the kanji for <b>evening</b> takes the ordinary looking <i>moon</i> in the night sky and has a cloud pass over it.', '夕', '', 17, '2010-09-16 05:15:37', '2010-10-03 03:30:00', 17, 17),
(4684, 1, 675, 'The english word for nightfall, or <b>eventide</b> is represnted in this kanji by <i>drops of water</i> inching their way up the shoreline in the <i>evening</i>.', '汐', '', 17, '2010-09-16 05:15:21', '2010-10-03 03:30:00', 17, 17),
(4685, 1, 675, 'On the left, the primitive for <i>evening</i>, and on the right, that for <i>magic wand</i>.  Now, as every magician knows, bringing your <i>magic wand</i> out in the <i>evening</i> air makes your magic much more powerful than if you were to stay indoors.  Hence, <i>evening</i> and <i>magic wands</i> takes you naturally <b>outside</b>.', '外', '', 17, '2010-09-16 05:15:30', '2010-10-03 03:30:00', 17, 17),
(4686, 1, 675, 'In certain African tribes, fathers visit their new-born babies in the middle of the night to whisper the child&#039;s <b>name</b> into its ear before making the choice public.  This <b>naming</b> custom fits in perfectly with the elements of this kanji: <i>evening</i> and <i>mouth</i>.  In the <i>evening</i>, a <i>mouth</i> pornounces the <b>name</b> that will accompany one throughout life.', '名', '', 17, '2010-09-16 05:16:14', '2010-10-03 03:30:00', 17, 17),
(4687, 1, 675, 'With a <i>mouth</i> under a <i>cliff</i>, what else could we have here but a secret cavern, with a great big <b>stone</b> rolled over the entrance.', '石', '', 17, '2010-09-16 05:15:59', '2010-10-03 03:30:00', 17, 17),
(4688, 1, 675, 'The word <b>resemblance</b> should suggest, among other things, a son&#039;s <b>resemblance</b> to his father.  A &quot;chip off the old block&quot; is the way we often put it, but the character is more simple; it speaks of a <i>little</i> bit of <i>flesh</i>.', '肖', '', 17, '2010-09-16 05:16:27', '2010-10-03 03:30:00', 17, 17),
(4689, 1, 675, 'The word <b>nitrate</b> should immediately suggest a beaker of nitric acid, which, as every high-school chemistry student knows, can eat its way through some pretty tough substances.  Here, we imagine pouring it over a <i>rock</i>, and watching <i>sparks</i> fly as it bores a hole through the rock.', '硝', '', 17, '2010-09-16 05:15:49', '2010-10-03 03:30:00', 17, 17),
