(4727, 1, 682, 'がくわりがつかえますか。', 'Kan jeg f&aring; studentrabatt?', '', 7, '2010-09-20 16:54:41', '2010-09-27 03:30:00', 7, 7),
(4728, 1, 682, 'かまくらいきのでんしゃはどれですか。', 'Hvilken er toget til Kamakura?', '', 7, '2010-09-20 16:54:07', '2010-09-27 03:30:00', 7, 7),
(4729, 1, 682, 'にばんせんです。', 'Det er spor to.', '', 7, '2010-09-20 16:54:12', '2010-09-27 03:30:00', 7, 7),
(4730, 1, 675, 'We begin with the two elements to the right, <i>baseball</i> and <i>needle</i>.  Since they will be coming together from time to time, let us give the two of them the sense of <i>game of cricket</i>, in which the <i>needle</i> is the wicket.  Imagine using a <i>rock</i> for a ball.  A <i>stone</i> ball would <b>smash</b> the <i>wicket</i> into into about <i>nine</i> thousand different pieces.', '砕', '', 17, '2010-09-20 05:13:36', '2010-10-07 03:30:00', 20, 19),
(4731, 1, 675, 'Good <b>sand</b> contains very <i>few rocks</i>.', '砂', '', 17, '2010-09-17 05:06:37', '2010-10-04 03:30:00', 17, 17),
(4732, 1, 675, 'Long before the invnetion of the carpenter&#039;s <b>plane</b>, people used knives and machetes (or, as seen here, <i>sabres</i>) to smooth out their woodwork.  If you have ever seen the process, you will be amazed to see the <i>sparks flying</i> from their <i>sabres</i> as they <b>plane</b> down the wood.', '削', '', 17, '2010-09-17 05:06:20', '2010-10-04 03:30:00', 17, 17),
(4733, 1, 675, 'There are two primitives here, <i>little</i> and <i>human legs</i>.  Now, if you have ever wondered about those little particles of &quot;dust&quot; that dance around in the light <b>rays</b> that come through the window and fall on your desk, try imagining them as <i>little</i> dancing <i>human legs</i>, doing the Can-can in the <b>rays</b> of sunlight on your desk.', '光', '', 17, '2010-09-17 05:06:06', '2010-10-04 03:30:00', 17, 17),
(4734, 1, 675, '<b>Plump</b> is one of those words that sounds like its meaning!  No sooner do you hear it than you think of a round and ample-bodied person falling into a sofa like a <i>large drop</i> - kerrrrr-<b>plump</b>!', '太', '', 17, '2010-09-17 05:06:28', '2010-10-04 03:30:00', 17, 17),
(4735, 1, 675, 'This kanji shows a <i>big dog</i> stretched out on a table, all stuffed and stewed and garnished with vegetables, with an apple in its mouth.  At each corner of the table sits an eager <i>mouth</i> waiting for <b>utensils</b> to arrive so the feast can begin.  Delicious!', '器', '', 17, '2010-09-17 05:05:20', '2010-10-04 03:30:00', 17, 17),
(4736, 1, 675, 'In the character for <b>stinking</b>, the super-sensitive <i>nose</i> of a <i>great big dog</i> is sniffing the air fo rthe source of some, foul, <b>stinking</b>, smell.', '臭', '', 17, '2010-09-17 05:06:51', '2010-10-04 03:30:00', 17, 17),
(4737, 1, 675, 'The kanji for <b>exquisite</b> contains the elements for <i>woman</i> and <i>few</i>, since an <b>exquisite</b> <i>woman</i> comes but <i>few</i> and far between.', '妙', '', 17, '2010-09-17 05:05:43', '2010-10-04 03:30:00', 17, 17),
(4738, 1, 675, 'When we <b>focus</b> on somehting, we give our attention to only a <i>few</i> matters, and <b>focus</b> our <i>eyes</i> only on them.', '省', '', 17, '2010-09-17 05:07:09', '2010-10-04 03:30:00', 17, 17),
(4739, 1, 675, 'The Japanese character for <b>thick</b> shows an abandonned <i>child</i>, under a hot <i>sun</i>, trapped at the bottom of a <i>cliff</i>.  If the child survives this, then he will live to be a very <b>thick</b>-skinned adult.', '厚', '', 17, '2010-09-17 05:05:11', '2010-10-04 03:30:00', 17, 17),
(4740, 1, 675, 'The elements we have here are a <i>big dog</i> and the elements <i>nail</i> and <i>mouth</i>.  Now all we have to do is create a ficticious &quot;<b>Strange</b> But True&quot; column in the Sunday funnies, featuring a <i>big dog</i> whose <i>mouth</i> has been <i>nailed</i> shut because we hit the brandy keg around his neck too hard.', '奇', '', 17, '2010-09-18 09:33:50', '2010-10-05 03:30:00', 19, 18),
(4741, 1, 683, 'New Question', 'New Answer', '', 0, '2010-05-04 19:32:59', '2010-05-04 19:32:59', 0, 0),
(4742, 1, 683, 'New Question', 'New Answer', '', 0, '2010-05-04 19:33:34', '2010-05-04 19:33:34', 0, 0),
(4743, 1, 683, 'We have taken the image of a river <b>stream</b> over into English to describe things that fall down in straight lines, or ripple along in lines.  All of this is more evident in the kanji given here, a pictograph of a <b>stream</b>.', '川', '', 17, '2010-09-18 09:41:15', '2010-10-05 03:30:00', 17, 17),
(4744, 1, 683, 'Here we see <i>drops of</i> land (little islets) rising out of a <i>stream</i>, creating a kind of sandbar or breakwater.  Ever wonder how the <b>state</b>-line is drawn between <b>states</b> separated by a river?  If there were little <i>drops of</i> land, as n the kanji, there&#039;s be nothing to it.', '州', '', 17, '2010-09-18 09:40:53', '2010-10-05 03:30:00', 17, 17),
(4745, 1, 683, 'In primitive language, the character would read <i>stream</i>...<i>head</i>.  And that turns out to be convenient in remembering the meaning <b>obey</b>.  Either one <b>obeys</b> the person who is <i>head</i> of ann organisation or else <b>obeys</b> by following the <i>stream</i> of opinion.  Both these senses come together in this kanji.', '順', '', 17, '2010-09-18 09:40:10', '2010-10-05 03:30:00', 17, 17),
(4746, 1, 683, 'This character is a pictograph of <b>water</b>.  Simply think of a <i>walking stick</i> being dropped vertically into the <b>water</b>, sending <i>droplets</i> out in all four directions.', '水', '', 17, '2010-09-18 09:39:48', '2010-10-05 03:30:00', 17, 17),
(4747, 1, 683, 'The kanji for <b>icicle</b> is the same as that for <i>water</i>, except, there has been an added <i>drop of</i> a cold, north-westerly wind, to cool the water down into a frozen <b>icicle</b>.', '氷', '', 17, '2010-09-18 09:41:52', '2010-10-05 03:30:00', 17, 17),
(4748, 1, 683, 'This kanji uses the full form of <i>water</i>, though <b>eternity</b> seems at first to have nothing to do with <i>water</i> at all.  Remember what William Blake said about seeing &quot;infinity in a grain of sand, and <b>eternity</b> in an hour&quot;?  Well, reading this character, top-to-bottom, we see &quot;<b>eternity</b> in a <i>drop of water</i>&quot;.', '永', '', 17, '2010-09-18 09:40:38', '2010-10-05 03:30:00', 17, 17),
(4749, 1, 683, 'Call to mind the image of a fresh, bubbling <b>spring</b> of water, and you will probably notice how the top of the <b>spring</b> is all <i>white</i>.  Happily, the character for <b>spring</b> shows <i>white</i> at the top, and <i>water</i> below.', '泉', '', 17, '2010-09-18 09:41:08', '2010-10-05 03:30:00', 17, 17),
(4750, 1, 683, 'Think of a mountain <b>meadow</b> in the Austrian Alps.  Imagine a little <i>spring</i>, bubbling up from underneath the <b>meadow</b>, leading to a mountain-<b>meadow</b>&#039;s <i>cliff</i>.', '原', '', 17, '2010-09-18 09:41:35', '2010-10-05 03:30:00', 17, 17),
(4751, 1, 683, 'A <i>meadow</i> and a <i>head</i> are all we are given to work with in the kanji for <b>petition</b>.  Since the keyword already suggests a request made of a higher power, let us imagine a giant Wizard of Oz <i>head</i>, in the middle of a <i>meadow</i>.  People will come from all around to <b>petition</b> the giant <i>head</i> for whatever they want.', '願', '', 17, '2010-09-18 09:40:27', '2010-10-05 03:30:00', 17, 17),
(4752, 1, 683, 'The primitive to the left represnets <i>water</i>.  The right, we see the kanji for <i>eternity</i>.  Knowing how much children love <b>swimming</b>, what could be a better representation than <b>swimming</b> in <i>water</i> for <i>eternity</i>?', '泳', '', 17, '2010-09-18 09:41:44', '2010-10-05 03:30:00', 17, 17),
(4753, 1, 683, '<b>Marshlands</b> are generally low-lying and near a source of <i>water</i>, that feeds them until they are soggy and wet all the way through.  <b>Marshlands</b> thrive on <i>water</i>, and so do all they can to <i>seduce</i> some wet stuff its way.', '沼', '', 17, '2010-09-18 09:40:46', '2010-10-05 03:30:00', 17, 17),
(4754, 1, 683, 'The kanji for <b>open sea</b> readily suggests being in the <i>middle</i> of a body fo <i>water</i>.', '沖', '', 17, '2010-09-18 09:41:26', '2010-10-05 03:30:00', 17, 17),
(4755, 1, 683, 'A <b>creek</b> is often just a dribble of <i>water</i> trickling down a small gully.  All of us know from our childhood how <b>creeks</b> are made.  You probably even dug one or two in your time!  All you need to do is find a mainstream of <i>water</i> somewhere and dig a little path into dry land.  The <b>creek</b> is a lesson in <i>water craft</i>, as this kanji would agree.', '江', '', 17, '2010-09-20 05:14:28', '2010-10-07 03:30:00', 17, 17),
(4756, 1, 683, 'To make <b>soup</b> one begins with <i>water</i>, and then starts adding things to it.  This is how the thick <b>soup</b> called &quot;seven-in-one&quot; is made.  This kanji does three better, giving us a <i>ten</i>-ingrdient <b>soup</b>.', '汁', '', 17, '2010-09-20 05:14:39', '2010-10-07 03:30:00', 17, 17),
(4757, 1, 683, 'On the left is <i>water</i>, and on the right, <i>morning</i>.  To get the meaning of the keyword <b>tide</b>, just think of a <i>morning</i>-<b>tide</b>, with <i>water</i> progressing up the shoreline in the <i>morning</i>.', '潮', '', 16, '2010-09-14 05:06:31', '2010-09-30 03:30:00', 21, 20),
(4758, 1, 683, 'It&#039;s easy to see <i>water</i> and meadow in the character for <b>source</b>.  Both in its etymology and popular usage, <b>source</b> suggests the place where <i>water</i> comes from.  In this kanji, it is under a <i>meadow</i>, where we just saw it breaking the surface in those bubbly little springs.', '源', '', 14, '2010-09-12 18:00:32', '2010-09-26 03:30:00', 27, 25),
(4759, 1, 683, 'When we speak of a <b>lively</b> personality, or a <b>lively</b> party, we immediately think of a lot of chatter.  This kanji depicts the idea of <b>lively</b> by having <i>tongues</i> babble and splash around like flowing <i>water</i>.', '活', '', 17, '2010-09-20 05:14:21', '2010-10-07 03:30:00', 17, 17),
(4760, 1, 683, 'Among the many things <i>water</i> is useful for is <b>extinguishing</b> fires, and that is just what we have here.  First of all, take the <i>water</i> at left as the <i>drops of water</i> that are used to depict <i>water</i> in general.  In the best of all possible worlds, the most efficient way to <b>extinguish</b> a fire would be to see that each <i>drop of water</i> hits one <i>spark</i> of the conflagration.  An unthinkable bit of utopian fire fighing, but helpful for assigning this keyword its primitives.', '消', '', 17, '2010-09-20 05:15:30', '2010-10-07 03:30:00', 17, 17),
(4761, 1, 683, 'This keyword is a connector used to link contrasting phrases and sentences together with much the same flavour as the English phrase <b>but of course</b>.  Just picture yourself ready to go on your first date as a <i>teenager</i>, and having your mother grill you about your manners and ask you embarassing questions about your hygiene.  &quot;Did you have a good shower?&quot;, &quot;<b>But of course</b>...&quot;, you reply, annoyed.  so <i>water</i> and <i>teenager</i> combine to give us <b>but of course</b>.', '況', '', 17, '2010-09-20 05:14:51', '2010-10-07 03:30:00', 17, 17),
(4762, 1, 683, 'The character in this frame represents a step up frm the <i>stream</i> we met earlier; it is a full-sized <b>river</b>.  The <i>water</i> to the left tells us what we are dealing with, and the <i>can</i> at the right tells us that our little engine that <i>could</i> has now become amphibious and is chugging down the mighty Mississippi like a regular <b>river</b>boat.', '河', '', 17, '2010-09-20 05:15:09', '2010-10-07 03:30:00', 17, 17),
(4763, 1, 683, 'When you stop at an inn for an <b>overnight</b> rest, all you expect is a bit of <i>water</i> for a wash and a set of clean <i>white</i> sheets to wrap your weary bones in.', '泊', '', 17, '2010-09-20 05:15:01', '2010-10-07 03:30:00', 17, 17),
(4764, 1, 683, '<i>Water...old...flesh</i>.  You have heard of legends of people being abandoned in the mountains when they had become too <i>old</i> to work.  Well, here is a legend about people being set adrift in the <i>waters</i> of a stormy <b>lake</b> because their <i>flesh</i> has gotten too <i>old</i> to bear the burdens of life.', '湖', '', 17, '2010-09-20 05:14:11', '2010-10-07 03:30:00', 17, 17),
(4765, 1, 683, 'Connoting the measurement of the depth of <i>water</i>, the keyword <b>fathom</b> begins with the <i>water</i> primitive and end with the element for <i>rule</i>.  Hence, when we <i>rule water</i>, we <b>fathom</b> it.  What could be simpler?', '測', '', 17, '2010-09-20 05:16:14', '2010-10-07 03:30:00', 17, 17),
(4766, 1, 683, 'This is a pictograph of a pile of soil, highly stylized.  Think of <i>ten</i> grains of <b>soil</b> piled up on the livingroom <i>floor</i>.', '土', '', 17, '2010-09-20 05:15:18', '2010-10-07 03:30:00', 17, 17),
(4767, 1, 684, 'New Question', 'New Answer', '', 1, '2010-05-07 18:54:38', '2010-05-08 03:30:00', 2, 1),
(4768, 1, 684, 'New Question2', 'New Answer2', '', 1, '2010-05-07 18:54:35', '2010-05-08 03:30:00', 1, 1),
(4769, 1, 684, 'New Question', 'New Answer', '', 1, '2010-05-07 18:54:32', '2010-05-08 03:30:00', 1, 1),
(4770, 1, 685, 'New Question', 'New Answer', '', 0, '2010-05-07 18:59:07', '2010-05-07 18:59:07', 0, 0),
(4771, 1, 686, '&#039;Read all about it&#039;', '&quot;I try out html entities&quot;<br/><br/>&aacute;&egrave;&icirc;&ouml;&ntilde; $&pound;&euro;&quot;&aring;&oslash;&aelig;', '', 0, '2010-05-07 19:17:10', '2010-05-07 19:17:10', 0, 0),
(4772, 1, 683, 'Here we have a rather <i>small</i> mouth, next to a much larger piece of <i>dirt</i>.  It is not hard to imagine what you would do if you had a large piece of <i>dirt</i> in your <i>mouth</i>: <b>spit</b> it out as fast and as far as you can!', '吐', '', 17, '2010-09-22 16:44:44', '2010-10-09 03:30:00', 17, 17),
(4773, 1, 683, 'One of the things that causes erosion of &lt;i&gt;soil&lt;/i&gt; is the excessive &lt;b&gt;pressure&lt;/b&gt; of the top&lt;i&gt;soil&lt;/i&gt; on the lower&lt;i&gt;soil&lt;/i&gt;.  here we see a steep and perilous &lt;i&gt;cliff&lt;/i&gt;.  The slightest &lt;b&gt;pressure&lt;/b&gt; on it will cause a landslide, which, with a little help from your imagination, you will be able to see happening with this character.', '圧', '', 17, '2010-09-24 19:26:04', '2010-10-11 03:30:00', 20, 19),
(4774, 1, 683, 'The &lt;b&gt;cape&lt;/b&gt; pictured here is a jut of &lt;i&gt;land&lt;/i&gt; like &lt;b&gt;Cape&lt;/b&gt; cod.  The &lt;i&gt;soil&lt;/i&gt; on the left tells us we have something to do with &lt;i&gt;land&lt;/i&gt;, and the &lt;i&gt;strange&lt;/i&gt; on the right tells us it is a &lt;b&gt;cape&lt;/b&gt; where unusual things go on.  The name of the place?  &lt;b&gt;Cape&lt;/b&gt; &lt;i&gt;strange&lt;/i&gt;.', '埼', '', 17, '2010-09-22 16:42:34', '2010-10-09 03:30:00', 17, 17),
(4775, 1, 683, 'The &lt;b&gt;hedge&lt;/b&gt; depicted here is not your ordinary, run-of-the-mill &lt;b&gt;hedge&lt;/b&gt;, but the miraculous &lt;b&gt;hedge&lt;/b&gt; of roses that completely &lt;i&gt;spanned&lt;/i&gt; the castle &lt;i&gt;grounds&lt;/i&gt; in which Sleeping Beauty lay for a hundred years, so that none but her beloved could find his way through.', '垣', '', 17, '2010-09-22 16:45:52', '2010-10-09 03:30:00', 17, 17),
(4776, 1, 683, 'The kanji keyword, &lt;b&gt;squared jewel&lt;/b&gt;, depicts a mammoth precious stone, several feet high, made by piling up large heaps of &lt;i&gt;soil&lt;/i&gt;, one on top of the other.', '圭', '', 17, '2010-09-22 16:45:25', '2010-10-09 03:30:00', 17, 17),
(4777, 1, 683, 'Think of the keyword &lt;b&gt;seal&lt;/b&gt; as referring to a letter you have written, and are preparing to close.  Instead of using the traditional wax &lt;b&gt;seal&lt;/b&gt;, you use a piece of &lt;i&gt;ivy&lt;/i&gt;, &lt;i&gt;glued&lt;/i&gt; to the outside.', '封', '', 16, '2010-09-21 16:55:17', '2010-10-07 03:30:00', 22, 21),
(4778, 1, 683, 'After seeing a constant &lt;b&gt;horizon&lt;/b&gt; of &lt;i&gt;water, water&lt;/i&gt;, everywhere for months at sea, you spot some &lt;i&gt;ivy&lt;/i&gt;-clad &lt;i&gt;cliffs&lt;/i&gt; on a new &lt;b&gt;horizon&lt;/b&gt;.', '涯', '', 17, '2010-09-22 16:45:12', '2010-10-09 03:30:00', 17, 17),
(4779, 1, 683, 'You have heard of people being attached to a particular Buddhist sect?  Here is your chance to take that metaphor literally and imagiine a fellow walking into a &lt;b&gt;Buddhist temple&lt;/b&gt; with a fervent resolve to attach himself to the place.  Since there is plenty of unused &lt;i&gt;land&lt;/i&gt; in the precincts, he simply picks out a suitable patch, and &lt;i&gt;glues&lt;/i&gt; himself to the &lt;i&gt;ground&lt;/i&gt;!', '寺', '', 17, '2010-09-22 16:43:32', '2010-10-09 03:30:00', 17, 17),
(4780, 1, 683, '&quot;What is &lt;b&gt;time&lt;/b&gt;?&quot; asked St. Augustine in his memoirs.  This kanji tell us that &lt;b&gt;time&lt;/b&gt; is the &lt;i&gt;sun&lt;/i&gt;, rising over a &lt;i&gt;buddhist temple&lt;/i&gt;.', '時', '', 17, '2010-09-22 16:43:06', '2010-10-09 03:30:00', 17, 17),
(4781, 1, 683, 'This kanji pictures &lt;i&gt;soil&lt;/i&gt; being scooped into a &lt;i&gt;ladle&lt;/i&gt;, and then made &lt;b&gt;level&lt;/b&gt; (apparently because one is measuring &lt;i&gt;soil&lt;/i&gt;).  The excess &lt;i&gt;drops of soil&lt;/i&gt; are brushed off the top, which accounts for the added &lt;i&gt;drop&lt;/i&gt; at the &lt;i&gt;ladle&#039;s&lt;/i&gt; edge.', '均', '', 17, '2010-09-22 16:44:54', '2010-10-09 03:30:00', 17, 17),
(4782, 1, 683, 'This kanji is a pictograph of a &lt;b&gt;flame&lt;/b&gt;.  It also looks like a &lt;i&gt;person&lt;/i&gt; with &lt;i&gt;drops of fire&lt;/i&gt; raining down on either side of him, as he runs away to safety.', '火', '', 17, '2010-09-22 16:44:36', '2010-10-09 03:30:00', 17, 17),
(4783, 1, 689, '&lt;disallowed&gt;&lt;br/&gt;&lt;disallowed bgcolor=&quot;#000000&quot;&gt;&lt;br/&gt;&lt;disallowed&gt;&lt;br/&gt;&lt;disallowed type=&quot;submit&quot; /&gt;&lt;br/&gt;&lt;disallowed&gt;textexttext&lt;/textarea&gt;&lt;br/&gt;&lt;/form&gt;&lt;br/&gt;&lt;/body&gt;&lt;br/&gt;&lt;/html&gt;', 'New Answer', '', 0, '2010-05-08 20:42:04', '2010-05-08 20:42:04', 0, 0);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(4784, 1, 683, 'A &lt;i&gt;fire&lt;/i&gt; belongs in the &lt;i&gt;hearth&lt;/i&gt;, not over it.  When a &lt;i&gt;fire&lt;/i&gt; spreads to the rest of the house, we have an &lt;b&gt;inflamed&lt;/b&gt; house.  As with any &lt;b&gt;inflammation&lt;/b&gt;, the danger is always that it might spread if not checked.  This is the sense behind the reduplication of the element for &lt;i&gt;fire&lt;/i&gt;, on atop the other.', '炎', '', 17, '2010-09-22 16:43:49', '2010-10-09 03:30:00', 17, 17),
(4785, 1, 683, 'The existential condition of &lt;b&gt;anxiety&lt;/b&gt; that arises from the inevitable frustration of our wordly passions is contained in this character.  The &lt;i&gt;head&lt;/i&gt; is set on &lt;i&gt;fire&lt;/i&gt;, causing deep &lt;b&gt;anxiety&lt;/b&gt;.', '煩', '', 11, '2010-09-19 08:38:13', '2010-09-30 03:30:00', 24, 23),
(4786, 1, 683, 'The primitives in this kanji read: &lt;i&gt;water...inflammation&lt;/i&gt;.  Taking &lt;i&gt;inflammation&lt;/i&gt; in its medical sense, the first &lt;i&gt;water&lt;/i&gt;-related &lt;i&gt;inflammation&lt;/i&gt; that pops into mind is dehydration, the principal sympton of which is that it makes one shrivel up and look very, very, &lt;b&gt;thin&lt;/b&gt;.', '淡', '', 17, '2010-09-22 16:44:17', '2010-10-09 03:30:00', 17, 17),
(4787, 1, 683, 'This kanji is made up of the elements &lt;i&gt;fire&lt;/i&gt; and &lt;i&gt;street&lt;/i&gt;.  Imagine a &lt;i&gt;street&lt;/i&gt;sign with a &lt;i&gt;flame&lt;/i&gt; on top.  Would that not make a perfect, if dangerus, &lt;b&gt;lamp&lt;/b&gt; for your living room?', '灯', '', 17, '2010-09-22 16:45:02', '2010-10-09 03:30:00', 17, 17),
(4788, 1, 683, 'Looking at the primitives, a &lt;i&gt;fireplace&lt;/i&gt; and a &lt;i&gt;rice field&lt;/i&gt;, we find the essential ingredients for a &lt;b&gt;farm&lt;/b&gt;: a warm &lt;i&gt;hearth&lt;/i&gt; to sit by at night, and a well-ploughed &lt;i&gt;field&lt;/i&gt; to grow one&#039;s crops in by day.', '畑', '', 17, '2010-09-22 16:42:23', '2010-10-09 03:30:00', 17, 17),
(4789, 1, 683, 'Of all nature&#039;s &lt;b&gt;disasters&lt;/b&gt;, this kanji picks ou two of the worst: &lt;i&gt;floods&lt;/i&gt; and &lt;i&gt;fires&lt;/i&gt;.', '災', '', 17, '2010-09-22 16:44:27', '2010-10-09 03:30:00', 17, 17),
(4790, 1, 683, 'The kanji for &lt;b&gt;ashes&lt;/b&gt; naturally includes the primitive for &lt;i&gt;fire&lt;/i&gt;, or more specifically, a &lt;i&gt;fireplace&lt;/i&gt;.  Now what do you do with that bucket of &lt;b&gt;ashes&lt;/b&gt; you just cleaned out of the &lt;i&gt;fireplace&lt;/i&gt;?  Chuck it off a &lt;i&gt;cliff&lt;/i&gt;.  Out of sight, out of mind.', '灰', '', 17, '2010-09-22 16:41:58', '2010-10-09 03:30:00', 17, 17),
(4791, 1, 683, 'If you look into the flickering of a &lt;i&gt;fire&lt;/i&gt; for a long time and then turn aside, you will see &lt;b&gt;spots&lt;/b&gt; before your eyes.  Imagine using those &lt;b&gt;spots&lt;/b&gt; as a technique for &lt;i&gt;fortune-telling&lt;/i&gt;.', '点', '', 17, '2010-09-22 16:44:03', '2010-10-09 03:30:00', 17, 17),
(4792, 1, 683, 'We shall focus on &quot;to make something &lt;i&gt;shine&lt;/i&gt;&quot; as the meaning of &lt;b&gt;illuminate&lt;/b&gt;.  If you glaze a pot and put it into the &lt;i&gt;oven&lt;/i&gt; to &lt;i&gt;fire&lt;/i&gt; it, you in fact &lt;b&gt;illuminate&lt;/b&gt; it.  Hence the kanji for &lt;b&gt;illuminate&lt;/b&gt; comprises the kanji for &lt;i&gt;shining&lt;/i&gt; and the primitive element for &lt;i&gt;oven&#039;s fire&lt;/i&gt;.', '照', '', 17, '2010-09-22 16:42:10', '2010-10-09 03:30:00', 17, 17),
(4793, 1, 683, 'The composition of this kanji shows three elements, which we list in the order of their writing: &lt;i&gt;bound up...rice field...cooking fire&lt;/i&gt;.  Not much to work with at first sight, but we can join them and &lt;i&gt;bind up&lt;/i&gt; a &lt;b&gt;fish&lt;/b&gt; on a line with its unfortunate school-mates; when the fisherman gets home, he cuts off the head and tosses it with the entrails, out into the &lt;i&gt;rice fields&lt;/i&gt; for fertilizer; and the rest he sets in a skillet over a &lt;i&gt;cooking fire&lt;/i&gt; for his supper.', '魚', '', 17, '2010-09-22 16:45:38', '2010-10-09 03:30:00', 17, 17),
(4794, 1, 683, 'The kanji for &lt;b&gt;fishing&lt;/b&gt; adds the element &lt;i&gt;water&lt;/i&gt; before the element for &lt;i&gt;fish&lt;/i&gt;.  Doesn&#039;t the &lt;i&gt;water&lt;/i&gt; look like a fishing rod?', '漁', '', 17, '2010-09-22 16:42:54', '2010-10-09 03:30:00', 17, 17),
