(5372, 1, 756, 'そうじをしたから、へやがきれいになりました。', 'Jeg riddet opp, derfor ble romet reint.', '', 8, '2010-09-25 10:12:32', '2010-10-03 03:30:00', 8, 8),
(5373, 1, 756, 'びよういんにいったから、かみがみじかくなりました。', 'Jeg var hos fris&oslash;ren, derfor ble h&aring;ret mitt kortere.', '', 8, '2010-09-25 10:12:19', '2010-10-03 03:30:00', 8, 8),
(5374, 1, 756, 'えんがやすくなりました。', 'Yen ble billigere.', '', 8, '2010-09-25 10:14:17', '2010-10-03 03:30:00', 8, 8);
