(5375, 1, 756, 'まいにちピアノをれんしゅうしているから、じょうずになりました。', 'Jeg &oslash;ver p&aring; piano hver dag, derfor er ejg flink.', '', 8, '2010-09-25 10:11:28', '2010-10-03 03:30:00', 8, 8),
(5376, 1, 756, 'おさけをたくさんのんで、かおがあおくなりました。', 'Jeg drakk mye alkohol og ansikten min ble hvitere.', '', 8, '2010-09-25 10:14:57', '2010-10-03 03:30:00', 8, 8),
(5377, 1, 756, '十一月はあたたかかったですが、このごろさむくなりました。', 'I november var det varmt, disse dagene blir det kaldere.', '', 8, '2010-09-25 10:12:05', '2010-10-03 03:30:00', 8, 8),
(5378, 1, 757, 'うちからえきまでじてんしゃでいきます。', 'Jeg g&aring;r med sykkel fra huset mitt til stasjonen.', '', 8, '2010-09-26 12:37:54', '2010-10-04 03:30:00', 8, 8),
(5379, 1, 757, 'うちからがっこうまでバスでいきます。', 'Jeg g&aring;r med bussen fra huset mitt til skole.', '', 8, '2010-09-26 12:46:16', '2010-10-04 03:30:00', 8, 8),
(5380, 1, 757, 'うちからバスていまであるいていきます。', 'Jeg g&aring;r p&aring; fot fra huset mitt til busstoppen.', '', 8, '2010-09-26 12:34:53', '2010-10-04 03:30:00', 8, 8),
(5381, 1, 757, 'うちからかいしゃまでくるまでいきます。', 'Jeg g&aring;r med bilen fra huset mitt til bedriften.', '', 8, '2010-09-26 12:41:13', '2010-10-04 03:30:00', 8, 8),
(5382, 1, 757, 'よこはまからとうきょうまででんしゃでいきます。', 'Jeg g&aring;r med tog fra Yokohama til Tokyo.', '', 8, '2010-09-26 12:37:01', '2010-10-04 03:30:00', 8, 8),
(5383, 1, 757, 'かいしゃからデパートまでちかてつでいきます。', 'Jeg g&aring;r med T-bannen fra bedriften til varehuset.', '', 8, '2010-09-26 12:29:30', '2010-10-04 03:30:00', 8, 8),
(5384, 1, 757, 'なごやからとうきょうまでしんかんせんでいきます。', 'Jeg g&aring;r med h&oslash;yhastighetstog fra Nagoya til Tokyo.', '', 8, '2010-09-26 12:37:21', '2010-10-04 03:30:00', 8, 8),
(5385, 1, 757, 'にほんからハワイまでひこうきでいきます。', 'Jeg g&aring;r med fly fra Japan til Hawaii.', '', 8, '2010-09-26 12:29:18', '2010-10-04 03:30:00', 8, 8),
(5386, 1, 757, 'にほんからインドネシアまでふねでいきます。', 'Jeg g&aring;r med b&aring;t fra Japan til Indonesia.', '', 8, '2010-09-26 12:34:47', '2010-10-04 03:30:00', 8, 8),
(5387, 1, 757, 'うちからえきまでじゅうぷんかかります。', 'Det tar ti minutter fra huset mitt til stasjonen.', '', 8, '2010-09-26 12:40:45', '2010-10-04 03:30:00', 8, 8),
(5388, 1, 757, 'うちからがっこうまでよんじゅうぷんかかります。', 'Det tar f&oslash;rti fra huset mitt til skole.', '', 8, '2010-09-26 12:37:33', '2010-10-04 03:30:00', 8, 8),
(5389, 1, 757, 'うちからバスていまでにじゅうぷんかかります。', 'Det tar tjue fra huset mitt til busstoppen.', '', 8, '2010-09-26 12:40:57', '2010-10-04 03:30:00', 8, 8),
(5390, 1, 757, 'うちからかいしゃまでくるまでいちじかかります。', 'Det tar ei time fra huset mitt til bedriften.', '', 8, '2010-09-26 12:34:39', '2010-10-04 03:30:00', 8, 8),
(5391, 1, 757, 'よこはまからとうきょうまでさんじゅうぷんかかります。', 'Det tar tretti minutter fra Yokohama til Tokyo.', '', 8, '2010-09-26 12:39:21', '2010-10-04 03:30:00', 8, 8),
(5392, 1, 757, 'かいしゃからデパートまでじゅうごふんかかります。', 'Det tar femton minutter fra bedriften til varehuset.', '', 8, '2010-09-26 12:32:03', '2010-10-04 03:30:00', 8, 8),
(5393, 1, 757, 'なごやからとうきょうまでにじかかります。', 'Det tar to timer fra Nagoya til Tokyo.', '', 8, '2010-09-26 12:29:36', '2010-10-04 03:30:00', 8, 8),
(5394, 1, 757, 'にほんからハワイまではちじかかります。', 'Det tar &aring;tte timer fra Japan til Hawaii.', '', 8, '2010-09-26 12:37:27', '2010-10-04 03:30:00', 8, 8),
(5395, 1, 757, 'にほんからインドネシアまでいちしゅうかかります。', 'Det tar ei uke fra Japan til Indonesia.', '', 8, '2010-09-26 12:37:38', '2010-10-04 03:30:00', 8, 8),
(5396, 1, 757, 'うちからみなみえきまでじてんしゃでいきます。ごふんかかります。', 'Jeg g&aring;r med sykkel fra huset mitt til Minami stasjon.  Det tar fem minutt.', '', 8, '2010-09-26 12:40:38', '2010-10-04 03:30:00', 8, 8),
(5397, 1, 757, 'みなみえきからにしえきまででんしゃにのります。にじゅうぷんかかります。', 'Jeg rir toget fra Minami stasjon til Nishi stasjon.  Det tar tjue minutt.', '', 8, '2010-09-26 12:31:59', '2010-10-04 03:30:00', 8, 8),
(5398, 1, 757, 'にしえきからがっこうまであるいていきます。じゅうぷんぐらいかかります。', 'Jeg g&aring;r p&aring; fots fra Nishi stasjon til skolen.  Det tar omtrent ti minutter.', '', 8, '2010-09-26 12:36:52', '2010-10-04 03:30:00', 8, 8),
(5399, 1, 764, 'メアリーさん、ひきしぶりですね。やすみはどうでしたか。', 'Mary, Jeg har ikke sett den for lenge.  Hvordan var ferien din?', '', 7, '2010-09-20 17:00:07', '2010-09-27 03:30:00', 7, 7),
(5400, 1, 764, 'すごくたのしかったです。かんこくでかいものをしたり、かんこくりょうりをたべたりしました。', 'Det var kjempe g&oslash;y.  Jeg handlet, spiste koreanske rett, og s&aring;nn type ting i korea.', '', 7, '2010-09-20 16:59:58', '2010-09-27 03:30:00', 7, 7),
(5401, 1, 764, 'いいですね。わたしもりょこうしたいです。', 'H&oslash;res flott.  Jeg vil ogs&aring; reise.', '', 7, '2010-09-20 17:00:31', '2010-09-27 03:30:00', 7, 7),
(5402, 1, 764, 'みちこさんのやすみはたのしかったですか。', 'Hadde du det g&oslash;y p&aring; ferie, Michiko?', '', 7, '2010-09-20 17:00:27', '2010-09-27 03:30:00', 7, 7),
(5403, 1, 764, 'まあまあでした。いちにちだけドライブにいきましたが、まいにちアルバイトをしていました。', 'Det var greit.  Jeg kj&oslash;rte bare i en dag, men jeg jobbet deltid hver dag.', '', 7, '2010-09-20 17:00:15', '2010-09-27 03:30:00', 7, 7),
(5404, 1, 765, 'みちこさん、ともだちをしょかいします。こちらはジョンさんはせんげつ、にほんにきました。', 'Michiko, jeg vil presentere deg til vennen min.  Han her er John.  Han kom til japan for en m&aring;nad siden.', '', 7, '2010-09-20 17:01:41', '2010-09-27 03:30:00', 7, 7),
(5405, 1, 765, 'はじめまして。', 'Hyggelig.', '', 7, '2010-09-20 17:01:45', '2010-09-27 03:30:00', 7, 7),
(5406, 1, 765, 'はじめまして、どうぞよろしく。', 'Hyggelig &aring; treffe.', '', 7, '2010-09-20 17:01:49', '2010-09-27 03:30:00', 7, 7),
(5407, 1, 766, 'ジョンさん、しゅっしんはどこですか。', 'John, hvor kommer du fra?', '', 7, '2010-09-20 17:02:31', '2010-09-27 03:30:00', 7, 7),
(5408, 1, 766, 'オーストラリアのケアンズです。', 'Jeg kommer fra Cairns, Australia.', '', 7, '2010-09-20 17:02:36', '2010-09-27 03:30:00', 7, 7),
(5409, 1, 766, 'そうですか。', 'Just det.', '', 7, '2010-09-20 17:02:45', '2010-09-27 03:30:00', 7, 7),
(5410, 1, 766, 'みちこさんはケアンズにいったことがありますか。', 'Har du v&aelig;rt i Cairns?', '', 7, '2010-09-20 17:02:54', '2010-09-27 03:30:00', 7, 7),
(5411, 1, 766, 'いいえ、ありません。', 'Nei, det har jeg ikke.', '', 7, '2010-09-20 17:02:12', '2010-09-27 03:30:00', 7, 7),
(5412, 1, 766, 'やまやうめがあって、きれいなところですよ。グレートバリアリーフでゆうめいです。みちこさんはどこのしゅっしんですか。', 'Den har fjell og havet, og er et vakkert sted.  Det er kjent for Great Barrier Reef.  Hvor kommer du fra, Michiko?', '', 7, '2010-09-20 17:02:40', '2010-09-27 03:30:00', 7, 7),
(5413, 1, 766, 'ながのです。こんどあそびにきてください。たべものもおいしいですよ。', 'Jeg kommer fra nagano.  Vennligst kom og bes&oslash;ke meg.  Maten er god, &oacute;g.', '', 7, '2010-09-20 17:02:49', '2010-09-27 03:30:00', 7, 7),
(5414, 1, 766, 'ぜひ、いきたいです。', 'Absolutt, gjerne.', '', 7, '2010-09-20 17:02:25', '2010-09-27 03:30:00', 7, 7),
