(5461, 1, 772, 'こんどのしゅうまつは、えいがをみたいです。', 'Jeg vil se en film p&aring; helgen.', '', 7, '2010-09-21 17:34:14', '2010-09-28 03:30:00', 7, 7),
(5462, 1, 772, 'いつかちゅうごくにいきたいです。', 'Jeg vil reise til kina en dag.', '', 7, '2010-09-21 17:33:41', '2010-09-28 03:30:00', 7, 7),
(5463, 1, 772, 'verb stem + たいです', 'Jeg vil...', '', 7, '2010-09-21 17:33:52', '2010-09-28 03:30:00', 7, 7),
(5464, 1, 772, 'あのひとにはもうあいたくありません。', 'Jeg vil ikke se denne personen lenger.', '', 7, '2010-09-21 17:33:35', '2010-09-28 03:30:00', 7, 7),
(5465, 1, 772, 'セーターがかいたかったから、テパートにいきました。', 'Jeg gikk p&aring; varehuset fordi jeg ville kj&oslash;pe en genser.', '', 7, '2010-09-21 17:34:20', '2010-09-28 03:30:00', 7, 7),
(5466, 1, 772, 'メアリーさんはトイレにいきたいといっていました。', 'Mary sa at hon ville g&aring; p&aring; WC-en.', '', 7, '2010-09-21 17:33:59', '2010-09-28 03:30:00', 7, 7),
(5467, 1, 772, 'メアリーさんはコーヒーをのみたがっています。', '(Det ser ut som) Mary vil drikke kaffe.', '', 7, '2010-09-21 17:33:47', '2010-09-28 03:30:00', 7, 7),
(5468, 1, 773, 'おおさかでかいものをして、かんこくりょうりをたべます。', 'I osaka skal jeg handle, og spise koreanske mat.', '', 7, '2010-09-21 17:34:52', '2010-09-28 03:30:00', 7, 7),
(5469, 1, 773, 'おおさかでかいものをしたりかんこくりょりをたべたります。', 'I osaka skall jeg gj&oslash;re ting som &aring; handle eller &aring; spise koreanske mat.', '', 7, '2010-09-21 17:34:58', '2010-09-28 03:30:00', 7, 7),
(5470, 1, 773, '(activity A) たり (activity B) たりする', '&Aring; gj&oslash;re ting som A eller B', '', 7, '2010-09-21 17:35:10', '2010-09-28 03:30:00', 7, 7),
(5471, 1, 773, 'しゅうまつはべんきょうしたり、ともだちとはなしたらしました。', 'Jeg studerte og snakket med vennene mine, blant annet, p&aring; helgen.', '', 7, '2010-09-21 17:35:17', '2010-09-28 03:30:00', 7, 7),
(5472, 1, 773, 'おどったり、おんがくをきいたりするのがすきです。', 'Jeg liker &aring; danse, &aring; h&oslash;re p&aring; musikk, og s&aring; videre.', '', 7, '2010-09-21 17:35:04', '2010-09-28 03:30:00', 7, 7),
(5473, 1, 774, 'ヨーロッパにいったことがありますか。', 'Har du v&aelig;rt til europa?', '', 7, '2010-09-21 17:32:54', '2010-09-28 03:30:00', 7, 7),
(5474, 1, 774, 'はい、いったことがあります。', 'Ja, det har jeg.', '', 7, '2010-09-21 17:32:49', '2010-09-28 03:30:00', 7, 7),
(5475, 1, 774, 'たけしさんはじゅきょうをやすんだことがありません。', 'Takeshi har aldri v&aelig;ret frav&aelig;rende fra leksjoner.', '', 7, '2010-09-21 17:32:36', '2010-09-28 03:30:00', 7, 7),
(5476, 1, 774, 'verb (kort, fortid) + ことがある', 'Jeg har erfaring i...', '', 7, '2010-09-21 17:32:42', '2010-09-28 03:30:00', 7, 7),
(5477, 1, 775, 'A や B', 'A og B, for eksempel', '', 7, '2010-09-21 17:36:07', '2010-09-28 03:30:00', 7, 7),
(5478, 1, 775, 'きょうとやならにいきました。', 'Jeg reiste til kyoto og nara, for eksampel.', '', 7, '2010-09-21 17:36:14', '2010-09-28 03:30:00', 7, 7),
(5479, 1, 763, 'どちらでもいいです。', 'Begge deler g&aring;r greit.', '', 7, '2010-09-21 17:45:53', '2010-09-28 03:30:00', 7, 7),
(5480, 1, 763, 'おなしです。', 'Samme tingen.', '', 7, '2010-09-21 17:45:37', '2010-09-28 03:30:00', 7, 7),
(5481, 1, 763, 'だいたいおなじです。', 'Mer eller mindre den samme.', '', 7, '2010-09-21 17:44:00', '2010-09-28 03:30:00', 7, 7),
(5482, 1, 763, 'ちょっとおがいます。', 'Litt ulike.', '', 7, '2010-09-21 17:43:28', '2010-09-28 03:30:00', 7, 7),
(5483, 1, 763, 'つかえません。', 'Kan ikke bruk det.', '', 7, '2010-09-21 17:44:18', '2010-09-28 03:30:00', 7, 7),
(5484, 1, 763, 'まちがっています。', 'Det er feil.', '', 7, '2010-09-21 17:41:21', '2010-09-28 03:30:00', 7, 7),
(5485, 1, 763, 'てをあげてじゅださい。', 'Opp med handen.', '', 7, '2010-09-21 17:45:09', '2010-09-28 03:30:00', 7, 7),
(5486, 1, 763, 'よんできてください。', 'Les den f&oslash;r du kom til leksjonen.', '', 7, '2010-09-21 17:42:20', '2010-09-28 03:30:00', 7, 7),
(5487, 1, 763, 'しゅくだいをだしてください。', 'Lever hjemmelekser.', '', 7, '2010-09-21 17:42:13', '2010-09-28 03:30:00', 7, 7),
(5488, 1, 763, 'きょうかしょをとじてください。', 'Lukk l&aelig;reboken', '', 7, '2010-09-21 17:41:29', '2010-09-28 03:30:00', 7, 7),
(5489, 1, 763, 'となりのひとにきいてください。', 'Sp&oslash;r han som sitter ved siden av deg.', '', 7, '2010-09-21 17:45:28', '2010-09-28 03:30:00', 7, 7),
(5490, 1, 763, 'やめてください。', 'Tiden er over, vennligst stopp.', '', 7, '2010-09-21 17:44:54', '2010-09-28 03:30:00', 7, 7),
(5491, 1, 763, 'きょうはこれでおわります。', 'Det er alt for i dag.', '', 7, '2010-09-21 17:41:15', '2010-09-28 03:30:00', 7, 7),
