(5515, 1, 776, 'Picture a &lt;i&gt;clam&lt;/i&gt; used as a &lt;i&gt;muzzle&lt;/i&gt; to quiet complaints of a fisherman&#039;s widow asking &lt;b&gt;compensation&lt;/b&gt; for her husband lost at sea.', '賠', '', 15, '2010-09-17 05:20:39', '2010-10-02 03:30:00', 15, 15),
(5516, 1, 776, 'The barrel hoops used by many japanese farmers to stretch clear plastic over a row of vegetable in a garden patch, in the hopes of &lt;b&gt;cultivating&lt;/b&gt; bigger and bigger vegetables is a way of &lt;i&gt;muzzling&lt;/i&gt; the &lt;i&gt;soil&lt;/i&gt;.', '培', '', 15, '2010-09-17 05:19:43', '2010-10-02 03:30:00', 15, 15),
(5517, 1, 776, 'To &quot;&lt;b&gt;divide&lt;/b&gt; and conquer&quot; you use a &lt;i&gt;saber&lt;/i&gt; and a &lt;i&gt;muzzle&lt;/i&gt;.', '剖', '', 15, '2010-09-17 05:20:17', '2010-10-02 03:30:00', 15, 15),
(5518, 1, 776, 'The kanji for &lt;b&gt;sound&lt;/b&gt; depicts somethign &lt;i&gt;standing&lt;/i&gt; in the air over a &lt;i&gt;tongue wagging in a mouth&lt;/i&gt;, much the same as a &lt;b&gt;sound&lt;/b&gt; does for the briefest of moments before disappearing.', '音', '', 15, '2010-09-17 05:19:25', '2010-10-02 03:30:00', 15, 15),
(5519, 1, 776, 'When &quot;&lt;b&gt;darkness&lt;/b&gt; covered the earth&quot; at the beginning of time, there was neither &lt;i&gt;sun&lt;/i&gt; nor &lt;i&gt;sound&lt;/i&gt;.', '暗', '', 15, '2010-09-18 09:50:41', '2010-10-03 03:30:00', 17, 16),
(5520, 1, 776, 'Poetry restricted to verses that &lt;b&gt;rhyme&lt;/b&gt; often finds it has to abandon clarity of thought in order to make the &lt;b&gt;rhyme&lt;/b&gt; of the words work.  In this kanji&#039;s picture, one becomes a kind of &quot;&lt;i&gt;sound-employee&lt;/i&gt;&quot;.', '韻', '', 15, '2010-09-17 05:20:04', '2010-10-02 03:30:00', 15, 15),
(5521, 1, 776, 'A person of &lt;b&gt;discriminating&lt;/b&gt; intellect can tell the difference between mere &lt;i&gt;kazoo&lt;/i&gt;-buzzing and &lt;i&gt;words&lt;/i&gt; being spoken wisely.', '識', '', 15, '2010-09-21 17:05:45', '2010-10-06 03:30:00', 20, 18),
(5522, 1, 776, 'After lakes, but before glass, polished &lt;i&gt;metal&lt;/i&gt; was used for &lt;b&gt;mirrors&lt;/b&gt;.  These &lt;i&gt;metal mirrors&lt;/i&gt; are recalled in this character for a &lt;b&gt;mirror&lt;/b&gt;.', '鏡', '', 15, '2010-09-24 19:43:18', '2010-10-09 03:30:00', 19, 18),
(5523, 1, 776, 'Imagine the &lt;b&gt;boundary&lt;/b&gt; of a plot of &lt;i&gt;land&lt;/i&gt; marked with gigantic &lt;i&gt;mirrors&lt;/i&gt; enabling the landowner to keep trespassers in sight at all times.', '境', '', 15, '2010-09-17 05:19:17', '2010-10-02 03:30:00', 15, 15),
(5524, 1, 776, 'A &lt;i&gt;top hat&lt;/i&gt; hanging on a &lt;i&gt;hook&lt;/i&gt; in the front hall, right where the &lt;b&gt;deceased&lt;/b&gt; left it the day he died, reminds us of him and his kanji.', '亡', '', 15, '2010-09-17 05:18:46', '2010-10-02 03:30:00', 15, 15),
(5525, 1, 776, 'If one&#039;s &lt;i&gt;eyes perish&lt;/i&gt; before death, one remains &lt;b&gt;blind&lt;/b&gt; for the rest of life.', '盲', '', 15, '2010-09-18 09:50:21', '2010-10-03 03:30:00', 17, 16),
(5526, 1, 776, 'The &quot;ideal &lt;i&gt;woman&lt;/i&gt;&quot; one daydreams about is no more than a &lt;b&gt;delusion&lt;/b&gt;.  Hence, &lt;i&gt;perish&lt;/i&gt; the thought of her!', '妄', '', 15, '2010-09-18 09:50:12', '2010-10-03 03:30:00', 15, 15),
(5527, 1, 776, 'The &lt;i&gt;flowers&lt;/i&gt; that &lt;i&gt;perish&lt;/i&gt; in the &lt;i&gt;flood&lt;/i&gt; are taken here as sumbols of an area that has been &lt;b&gt;laid waste&lt;/b&gt;.', '荒', '', 15, '2010-09-18 09:49:35', '2010-10-03 03:30:00', 15, 15),
(5528, 1, 776, 'The story of &lt;b&gt;ambition&lt;/&gt; talks of a &lt;i&gt;king&lt;/i&gt; walking under the &lt;i&gt;perishing&lt;/i&gt; (or &quot;waning&quot;) &lt;i&gt;moon&lt;/i&gt;, dreaming great dream about his kingdom.  (The roots of &lt;b&gt;ambition&lt;/b&gt; are from the same word as &quot;ambulate&quot;; to walk about).', '望', '', 15, '2010-09-18 09:50:01', '2010-10-03 03:30:00', 15, 15),
(5529, 1, 776, 'Spinning a &lt;i&gt;dagger&lt;/i&gt; about on its hilt on the top of a &lt;i&gt;top hat&lt;/i&gt; - waiting to see which &lt;b&gt;direction&lt;/b&gt; it points when it comes to rest - one leaves to fate where one is going next.  Take care in writing this character.', '方', '', 15, '2010-09-18 09:51:09', '2010-10-03 03:30:00', 15, 15),
(5530, 1, 776, 'Imagine a &lt;i&gt;compass&lt;/i&gt; that is &lt;b&gt;disturbed&lt;/b&gt; everytime a &lt;i&gt;woman&lt;/i&gt; passes by, sending the needle spinning madly round and round.', '妨', '', 15, '2010-09-18 09:51:21', '2010-10-03 03:30:00', 15, 15),
(5531, 1, 776, 'The character for a &lt;b&gt;boy&lt;/b&gt; shows us a &lt;b&gt;Boy&lt;/b&gt; Scout cleaning the &lt;i&gt;dirt&lt;/i&gt; out of his &lt;i&gt;compass&lt;/i&gt; - the more &lt;i&gt;dirt&lt;/i&gt;, the better.', '坊', '', 15, '2010-09-18 09:49:22', '2010-10-03 03:30:00', 15, 15),
(5532, 1, 776, 'Here we see a special &lt;i&gt;compass&lt;/i&gt; used to pick out those &lt;i&gt;flowers&lt;/i&gt; most suited for making good &lt;b&gt;perfumes&lt;/b&gt;.', '芳', '', 15, '2010-09-18 09:51:46', '2010-10-03 03:30:00', 15, 15),
(5533, 1, 776, 'If you eat too much, you may need a &lt;i&gt;compass&lt;/i&gt; to find your way around the &lt;b&gt;obese&lt;/b&gt; mass of &lt;i&gt;flesh&lt;/i&gt; that piles up in your midsection.', '肪', '', 15, '2010-09-18 09:49:47', '2010-10-03 03:30:00', 15, 15),
(5534, 1, 776, 'When making a courtesy &lt;b&gt;call on&lt;/b&gt; a dignitary, one has to gauge one&#039;s &lt;i&gt;words&lt;/i&gt; with great care.  Hence the need for a &lt;i&gt;compass&lt;/i&gt;.', '訪', '', 15, '2010-09-18 09:50:58', '2010-10-03 03:30:00', 15, 15),
(5535, 1, 776, 'The &lt;i&gt;taskmaster&lt;/i&gt; &lt;b&gt;sets&lt;/b&gt; an unruly servant &lt;b&gt;free&lt;/b&gt;, giving him no more than a quick glance at the &lt;i&gt;compass&lt;/i&gt;, and a boot from behind.', '放', '', 15, '2010-09-18 09:51:40', '2010-10-03 03:30:00', 15, 15),
(5536, 1, 776, 'Some cosmic &lt;i&gt;taskmaster&lt;/i&gt; hovering overhead whips up the waves to make them dash &lt;b&gt;violently&lt;/b&gt; against the shore.  In the &lt;i&gt;white&lt;/i&gt; foam that covers the &lt;i&gt;water&lt;/i&gt;, we see a broken &lt;i&gt;compass&lt;/i&gt;, floating -  all that remains of a shipwreck.', '激', '', 15, '2010-09-24 19:43:41', '2010-10-09 03:30:00', 19, 18),
(5537, 1, 776, 'To &lt;b&gt;undress&lt;/b&gt; is to expose the &lt;i&gt;flesh&lt;/i&gt; and tempt the &lt;i&gt;devil&lt;/i&gt; in the eyes of one&#039;s onlookers.  Ignore the moral, if you want, but don&#039;t ignore the &lt;i&gt;devil&lt;/i&gt;.', '脱', '', 15, '2010-09-19 08:50:46', '2010-10-04 03:30:00', 15, 15),
(5538, 1, 776, 'Not inappropriately, this character likens a &lt;b&gt;rumour&lt;/b&gt; to the &lt;i&gt;devil&#039;s&lt;/i&gt; own &lt;i&gt;words&lt;/i&gt;.', '説', '', 15, '2010-09-19 08:52:37', '2010-10-04 03:30:00', 15, 15),
(5539, 1, 776, '&lt;i&gt;Metal&lt;/i&gt; that has been &lt;b&gt;pointed&lt;/b&gt; tends to serve the &lt;i&gt;devil&#039;s&lt;/i&gt; purposes, as well, as civilizations: our tools are also our weapons.', '鋭', '', 15, '2010-09-19 08:53:03', '2010-10-04 03:30:00', 15, 15),
(5540, 1, 776, 'This primitive is composed of a pair of &lt;i&gt;horns&lt;/i&gt; growing out of a &lt;i&gt;brain&lt;/i&gt; with a &lt;i&gt;tongue wagging in the mouth&lt;/i&gt; beneath.  Think of &quot;&lt;b&gt;former&lt;/b&gt;&quot; in connection with administrators or heads of state who have just left office, but continue to make a nuisance of themselves by advertising their opinions on public policy.', '曽', '', 15, '2010-09-19 08:51:10', '2010-10-04 03:30:00', 15, 15),
(5541, 1, 776, 'This kanji depicts an &lt;b&gt;increase&lt;/b&gt; of &lt;i&gt;soil&lt;/i&gt;, multiplying so fast that it literally buries everything in its path.', '増', '', 15, '2010-09-19 08:53:13', '2010-10-04 03:30:00', 15, 15),
(5542, 1, 776, 'The &lt;b&gt;presents&lt;/b&gt; offered here are &lt;i&gt;money&lt;/i&gt; that &lt;i&gt;increases&lt;/i&gt; each time you give it away.', '贈', '', 14, '2010-09-15 05:26:57', '2010-09-29 03:30:00', 19, 18),
(5543, 1, 776, 'As a &quot;Western&quot; language, English identifies the &lt;b&gt;east&lt;/b&gt; with the rising &lt;i&gt;sun&lt;/i&gt;.  In more fanciful terms, we see the &lt;i&gt;sun&lt;/i&gt;, piercing through a &lt;i&gt;tree&lt;/i&gt; as it rises in the &lt;b&gt;east&lt;/b&gt;.', '東', '', 15, '2010-09-19 08:52:53', '2010-10-04 03:30:00', 15, 15),
(5544, 1, 776, 'If the piece of &lt;i&gt;wood&lt;/i&gt; in the roof known as the &lt;b&gt;ridgepole&lt;/b&gt; points &lt;i&gt;east&lt;/i&gt;, the sunrise will be visible from teh front door.', '棟', '', 15, '2010-09-19 08:51:32', '2010-10-04 03:30:00', 15, 15),
(5545, 1, 776, 'the whole secret to breaking the &lt;i&gt;ice&lt;/i&gt; with the &lt;i&gt;East&lt;/i&gt; is to peek behind those mysteriously &quot;&lt;b&gt;frozen&lt;/b&gt; smiles&quot;.', '凍', '', 15, '2010-09-19 08:52:07', '2010-10-04 03:30:00', 15, 15),
(5546, 1, 776, 'A &lt;i&gt;woman&lt;/i&gt; who is in her &lt;b&gt;pregnancy&lt;/b&gt; is a bit like a &lt;i&gt;porter&lt;/i&gt;, bearing her new companion wherever she goes.', '妊', '', 15, '2010-09-19 08:51:20', '2010-10-04 03:30:00', 15, 15),
(5547, 1, 776, 'Those who rule the &lt;b&gt;courts&lt;/b&gt;, the &lt;i&gt;porters&lt;/i&gt; fo justice and order, are often found to &lt;i&gt;stretch&lt;/i&gt; the law to suit their own purposes.', '廷', '', 15, '2010-09-19 08:52:22', '2010-10-04 03:30:00', 15, 15),
(5548, 1, 777, 'In olden times, they used to make &lt;b&gt;dyes&lt;/b&gt; out of plants.  Here we see how they did it in ancient japan: &lt;i&gt;water&lt;/i&gt; was added in &lt;i&gt;nine&lt;/i&gt; parts to the leaves of a &lt;i&gt;tree&lt;/i&gt;, to make a runny &lt;b&gt;dye&lt;/b&gt;.', '染', '', 15, '2010-09-21 17:08:42', '2010-10-06 03:30:00', 15, 15),
(5549, 1, 777, 'A hot-dog &lt;i&gt;sort of thing&lt;/i&gt;, when ready, needs to be taken away from the &lt;i&gt;flames&lt;/i&gt; of the grill, otherwise, it will start to &lt;b&gt;burn&lt;/b&gt;.', '燃', '', 15, '2010-09-21 17:09:24', '2010-10-06 03:30:00', 15, 15),
(5550, 1, 777, 'Here we see a description of the &lt;b&gt;V.I.P&lt;/b&gt; lifestyle.  A &lt;i&gt;house&lt;/i&gt; on the top &lt;i&gt;floor&lt;/i&gt; (a penthouse), and &lt;i&gt;few oysters&lt;/i&gt; sitting ont eh kitchen table, ready for dinner, every night.', '賓', '', 15, '2010-09-21 17:08:09', '2010-10-06 03:30:00', 15, 15),
(5551, 1, 777, 'At the &lt;b&gt;year-end&lt;/b&gt; we &lt;i&gt;stop&lt;/i&gt; the &lt;i&gt;march&lt;/i&gt; of time just &lt;i&gt;little&lt;/i&gt;, in order to celebrate.', '歳', '', 15, '2010-09-21 17:09:41', '2010-10-06 03:30:00', 15, 15),
(5552, 1, 777, 'The japanese &lt;b&gt;prefectures&lt;/b&gt; compete with eachother for attention.  These &lt;i&gt;small&lt;/i&gt; states of japan try to catch your &lt;i&gt;eye&lt;/i&gt; in order to catch your money.  Maybe the coastal &lt;b&gt;prefectures&lt;/b&gt; use pictures of &lt;i&gt;fish-hooks&lt;/i&gt; and fishing to entice you to visit.', '県', '', 15, '2010-09-21 17:08:25', '2010-10-06 03:30:00', 15, 15),
(5553, 1, 777, 'According to myth, &lt;i&gt;trees&lt;/i&gt; growing at the edge of a &lt;i&gt;cliff&lt;/i&gt; will be rich in their fruit.  A &lt;b&gt;horse-chestnut&lt;/b&gt; &lt;i&gt;tree&lt;/i&gt; will grow up to &lt;i&gt;ten thousand&lt;/i&gt; nuts, from the &lt;i&gt;cliff&lt;/i&gt;-side ground.', '栃', '', 15, '2010-09-21 17:09:05', '2010-10-06 03:30:00', 15, 15),
(5554, 1, 778, 'After releasing its poisonous venom, a &lt;i&gt;scorpion&lt;/i&gt; on the &lt;b&gt;ground&lt;/b&gt; will bury into the &lt;i&gt;soil&lt;/i&gt; to await its next victim.', '地', '', 15, '2010-09-21 17:11:37', '2010-10-06 03:30:00', 15, 15),
(5555, 1, 778, 'Although this refers to a &lt;b&gt;pond&lt;/b&gt; of &lt;i&gt;water&lt;/i&gt;, let&#039;s use the image of a &lt;b&gt;pond&lt;/b&gt; infested with &lt;i&gt;scorpions&lt;/i&gt;.', '池', '', 15, '2010-09-21 17:13:48', '2010-10-06 03:30:00', 15, 15),
(5556, 1, 778, 'The kanji for &lt;b&gt;insect&lt;/b&gt; is a pictograph.  Learn it.', '虫', '', 15, '2010-09-21 17:13:31', '2010-10-06 03:30:00', 15, 15),
(5557, 1, 778, 'a poor &lt;i&gt;schoolhouse&lt;/i&gt; can&#039;t afford electricity, so they get som little &lt;i&gt;insects&lt;/i&gt; in to help.  What sort of insects?  &lt;b&gt;Lightning bugs&lt;/b&gt;.', '蛍', '', 15, '2010-09-21 17:11:05', '2010-10-06 03:30:00', 15, 15),
(5558, 1, 778, 'When an &lt;i&gt;insect&lt;/i&gt; gets into your &lt;i&gt;house&lt;/i&gt;, your mum might chase it around with a &lt;i&gt;spoon&lt;/i&gt;, trying to bludgeon it to death.  Other households will try to scoop up the insect to feed a contented pet &lt;b&gt;snake&lt;/b&gt;.', '蛇', '', 15, '2010-09-21 17:12:45', '2010-10-06 03:30:00', 15, 15),
(5559, 1, 778, 'It is a little known fact that Noah didn&#039;t take any &lt;i&gt;insects&lt;/i&gt; onto the ark.  Instead, they snuck onboard one night, and hid in the &lt;i&gt;I-beams&lt;/i&gt;.  Thus the connection between &lt;i&gt;insect, craft&lt;/i&gt;, and &lt;b&gt;rainbow&lt;/b&gt;.', '虹', '', 15, '2010-09-21 17:14:56', '2010-10-06 03:30:00', 15, 15),
(5560, 1, 778, 'The &lt;b&gt;butterfly&lt;/b&gt; is an &lt;i&gt;insect&lt;/i&gt; that uses a &lt;i&gt;generation&lt;/i&gt; up a &lt;i&gt;tree&lt;/i&gt;, wrapped up tightly in a cocoon, to turn into somethign beautiful.', '蝶', '', 15, '2010-09-21 17:11:27', '2010-10-06 03:30:00', 15, 15),
(5561, 1, 778, 'There are two kinds of &lt;b&gt;single&lt;/b&gt; people: those who behave like &lt;i&gt;wild dogs&lt;/i&gt;, and those who live like &lt;i&gt;insects&lt;/i&gt;.  No wonder no-one wants them!', '独', '', 15, '2010-09-21 17:13:08', '2010-10-06 03:30:00', 15, 15),
(5562, 1, 778, 'The &lt;b&gt;silkworm&lt;/b&gt;, which produces such fine wares, certainly came form &lt;i&gt;heaven&lt;/i&gt;, and stands above all other &lt;i&gt;insects&lt;/i&gt;', '蚕', '', 15, '2010-09-21 17:14:43', '2010-10-06 03:30:00', 15, 15),
(5563, 1, 778, 'If you&#039;ve ever been in a swarm of locusts, you&#039;ll have no trouble remembering the kanji for &lt;b&gt;wind&lt;/b&gt;.  Just imagine the hurricane-like &lt;i&gt;wind&lt;/i&gt;, with &lt;i&gt;drops&lt;/i&gt; of &lt;i&gt;insects&lt;/i&gt;, flying around inside.  Now that&#039;s &lt;b&gt;wind&lt;/b&gt;!', '風', '', 15, '2010-09-21 17:10:43', '2010-10-06 03:30:00', 15, 15),
(5564, 1, 778, 'The kanji carries the abstract sense of the &lt;b&gt;self&lt;/b&gt;, the deep-down inner structure of the human person that mythology has often depicted as a snake, which this kanji shows pictographically.  Ssss!', '己', '', 15, '2010-09-21 17:10:52', '2010-10-06 03:30:00', 15, 15),
(5565, 1, 778, 'If a &lt;i&gt;snake&lt;/i&gt; found its way into your bed, you would be &lt;b&gt;roused&lt;/b&gt; very quickly, a &lt;i&gt;run&lt;/i&gt; as fast as you could to the edge of the room.', '起', '', 15, '2010-09-21 17:14:26', '2010-10-06 03:30:00', 15, 15),
