(6196, 1, 803, 'やましたせんせいはさかながすきじゃないでしょう。', 'Prof. Yamashita liker sannsynligvis ikke fisk.', '', 0, '2010-07-04 16:52:06', '2010-07-04 16:52:06', 0, 0),
(6197, 1, 803, 'あのひとはオーストラリアじんでしょう。', 'Den personen er trolig fra australia.', '', 0, '2010-07-04 16:55:22', '2010-07-04 16:55:22', 0, 0),
