(6199, 1, 803, 'にほんごとかんこくごと、どっちのほうがむずかしいでしょうか。', 'Hvilken tror du er vanskeligere, Japansk eller Koreansk?', '', 0, '2010-07-04 17:05:34', '2010-07-04 17:05:34', 0, 0),
(6200, 1, 803, 'たけしさんはきょうみがあるだるうとおもいます。', 'Jeg tror Takeshi ville v&aelig;re interessert i det.', '', 0, '2010-07-04 17:06:29', '2010-07-04 17:06:29', 0, 0),
(6201, 1, 803, 'ジョン、ちゅうごくごがわかるでしょ？これよんで。', 'John, du forst&aring;r kinesisk, ikke sant?  Kan du lese den for meg?', '', 0, '2010-07-04 17:07:34', '2010-07-04 17:07:34', 0, 0),
(6202, 1, 811, 'If you need to kill some time in Tokyo, it&#039;s often a good idea to &lt;i&gt;go&lt;/i&gt; to a &lt;i&gt;buddhist&lt;/i&gt; temple, and &lt;b&gt;wiat&lt;/b&gt; there in nice surroundings.', '待', '', 13, '2010-09-21 17:27:15', '2010-10-04 03:30:00', 13, 13),
(6203, 1, 811, 'In days gone by, &lt;b&gt;journeying&lt;/b&gt; from one place to another required &lt;i&gt;going&lt;/i&gt; from one &lt;i&gt;lord&lt;/i&gt; to the next and asking for safe passage.', '往', '', 13, '2010-09-21 17:25:59', '2010-10-04 03:30:00', 13, 13),
(6204, 1, 811, 'To &lt;i&gt;correct&lt;/i&gt; a &lt;i&gt;column&lt;/i&gt; of people is to &lt;b&gt;subjugate&lt;/b&gt; them to your authority.', '征', '', 13, '2010-09-21 17:26:34', '2010-10-04 03:30:00', 13, 13),
(6205, 1, 811, 'To measure the &lt;b&gt;diameter&lt;/b&gt; of a circle, take out a &lt;i&gt;spool&lt;/i&gt; of thread, and mark a &lt;i&gt;line&lt;/i&gt; with it across the circle.  If you measure the length of the line/thread, then you will find the &lt;b&gt;diameter&lt;/b&gt;.', '径', '', 13, '2010-09-24 20:23:45', '2010-10-07 03:30:00', 16, 15),
(6206, 1, 811, 'All the cavemen are &lt;i&gt;going&lt;/i&gt; around in the latest fashion-&lt;i&gt;pelts&lt;/i&gt;, except for one.  &lt;b&gt;He&lt;/b&gt; doesn&#039;t buy into all this modern caveman nonsense!', '彼', '', 13, '2010-09-21 17:26:08', '2010-10-04 03:30:00', 13, 13),
(6207, 1, 811, 'When a &lt;i&gt;missile&lt;/i&gt; is &lt;i&gt;going&lt;/i&gt; to blow up your country, it is important that you do your &lt;b&gt;duty&lt;/b&gt;, and get the hell out of dodge.', '役', '', 13, '2010-09-21 17:27:30', '2010-10-04 03:30:00', 13, 13),
(6208, 1, 811, 'The kanji for &lt;b&gt;benevolence&lt;/b&gt; includes the primitives for &lt;i&gt;going, needle, eye&lt;/i&gt; and &lt;i&gt;heart&lt;/i&gt;.', '徳', '', 13, '2010-09-21 17:25:37', '2010-10-04 03:30:00', 13, 13),
(6209, 1, 811, '&lt;b&gt;Penetrating&lt;/b&gt; a vagina can lead to a &lt;i&gt;line&lt;/i&gt; of children to &lt;i&gt;bring up&lt;/i&gt;.  If you do that much &lt;b&gt;penetrating&lt;/b&gt;, then I do hope that you are a good &lt;i&gt;taskmaster&lt;/i&gt;, to keep them all under control!', '徹', '', 13, '2010-09-21 17:27:00', '2010-10-04 03:30:00', 13, 13),
(6210, 1, 811, 'The &lt;i&gt;line&lt;/i&gt; of dead slaves leading up the home of the &lt;i&gt;mountain king&lt;/i&gt;, is a good &lt;b&gt;indication&lt;/b&gt; that he is a hard &lt;i&gt;taskmaster&lt;/i&gt;.', '徴', '', 13, '2010-09-21 17:25:26', '2010-10-04 03:30:00', 13, 13),
(6211, 1, 811, '&lt;i&gt;Indications&lt;/i&gt; that someone has just experienced some &lt;b&gt;penal&lt;/b&gt; justice includes a hardness in the &lt;i&gt;heart&lt;/i&gt;.', '懲', '', 13, '2010-09-21 17:27:49', '2010-10-04 03:30:00', 13, 13),
(6212, 1, 811, 'Up in the mountains, there is a &lt;i&gt;line&lt;/i&gt; of painters, painting the &lt;i&gt;ceiling&lt;/i&gt; of the earth.  Their &lt;i&gt;human legs&lt;/i&gt; peak out from the clouds, and a &lt;i&gt;taskmaster&lt;/i&gt; watches on to ensure the &lt;b&gt;delicate&lt;/b&gt; work of painting the skys is completed correctly.', '微', '', 13, '2010-09-21 17:25:50', '2010-10-04 03:30:00', 13, 13),
(6213, 1, 811, 'Here we see that a &lt;i&gt;boulevard&lt;/i&gt; with &lt;i&gt;ivy&lt;/i&gt; trellaces is the prototypical &lt;b&gt;boulevard&lt;/b&gt;.', '街', '', 13, '2010-09-21 17:26:19', '2010-10-04 03:30:00', 13, 13),
(6214, 1, 811, 'Just as the two sides of a &lt;i&gt;boulevard&lt;/i&gt; are in equilibrium with each other as regards traffic, so too would we humans be in equilibrium with a &lt;i&gt;St. Bernard dog&lt;/i&gt;, if we &lt;i&gt;bound up&lt;/i&gt; our &lt;i&gt;brains&lt;/i&gt;.', '衡', '', 13, '2010-09-21 17:26:49', '2010-10-04 03:30:00', 13, 13),
(6215, 1, 812, 'A &lt;b&gt;draft&lt;/b&gt; document contains both &lt;i&gt;wheat&lt;/i&gt; and chaff.  The &lt;i&gt;tall&lt;/i&gt; tales must be removed form the &lt;b&gt;draft&lt;/b&gt; as chaff, in order to make it into a real version.', '稿', '', 13, '2010-09-22 16:57:15', '2010-10-05 03:30:00', 13, 13),
(6216, 1, 812, 'Just as one reaps &lt;i&gt;wheat&lt;/i&gt; for the &lt;i&gt;house&lt;/i&gt;hold, so to does one reap &lt;b&gt;earnings&lt;/b&gt; for the same.', '稼', '', 10, '2010-09-17 05:26:34', '2010-09-27 03:30:00', 18, 17),
(6217, 1, 812, 'The &lt;b&gt;extent&lt;/b&gt; of the farmer&#039;s pride was obvious.  He even put his own &lt;i&gt;wheat&lt;/i&gt; on &lt;i&gt;display&lt;/i&gt;!', '程', '', 13, '2010-09-22 16:55:28', '2010-10-05 03:30:00', 13, 13),
(6218, 1, 812, '&lt;b&gt;Tax&lt;/b&gt; is &lt;i&gt;wheat&lt;/i&gt; for the &lt;i&gt;devil&lt;/i&gt; to make bread with.', '税', '', 13, '2010-09-22 16:57:37', '2010-10-05 03:30:00', 13, 13),
(6219, 1, 812, 'An &lt;b&gt;immature&lt;/b&gt; &lt;i&gt;turkey&lt;/i&gt; must be fed &lt;i&gt;wheat&lt;/i&gt; until it is big enough and old enough to eat something else.', '稚', '', 13, '2010-09-22 16:56:16', '2010-10-05 03:30:00', 13, 13),
(6220, 1, 812, 'When singing in &lt;b&gt;harmony&lt;/b&gt;, some singers need to change their voice.  They do that by changing the shape of their &lt;i&gt;mouth&lt;/i&gt; by stuffing it with &lt;i&gt;wheat&lt;/i&gt;.', '和', '', 9, '2010-09-25 11:18:32', '2010-10-04 03:30:00', 19, 18),
(6221, 1, 812, 'In the autun, there are &lt;i&gt;many&lt;/i&gt; bails of &lt;i&gt;wheat&lt;/i&gt; to &lt;b&gt;shift&lt;/b&gt;.', '移', '', 13, '2010-09-22 16:56:06', '2010-10-05 03:30:00', 13, 13),
(6222, 1, 812, 'It only takes a &lt;b&gt;second&lt;/b&gt; to harvest a &lt;i&gt;few&lt;/i&gt; grains of &lt;i&gt;wheat&lt;/i&gt;.', '秒', '', 13, '2010-09-22 16:55:37', '2010-10-05 03:30:00', 13, 13),
(6223, 1, 812, 'In the &lt;b&gt;autumn&lt;/b&gt;, we gather in the &lt;i&gt;wheat&lt;/i&gt;, and set it on &lt;i&gt;fire&lt;/i&gt;, because we&#039;re self-sabotaging.', '秋', '', 13, '2010-09-22 16:55:45', '2010-10-05 03:30:00', 13, 13),
(6224, 1, 812, 'In your &lt;i&gt;autumn&lt;/i&gt; years, your &lt;i&gt;heart&lt;/i&gt; may cause you &lt;b&gt;distress&lt;/b&gt;, because you&#039;re getting pretty old gramps.', '愁', '', 13, '2010-09-22 16:56:28', '2010-10-05 03:30:00', 13, 13),
(6225, 1, 812, 'In the &lt;i&gt;wheat&lt;/i&gt; fields, with your &lt;i&gt;elbow&lt;/i&gt; in motion, can only mean that you want a little &lt;b&gt;private&lt;/b&gt; time.', '私', '', 13, '2010-09-22 16:56:37', '2010-10-05 03:30:00', 13, 13),
(6226, 1, 812, 'When shaken, &lt;i&gt;wheat&lt;/i&gt; grains will &lt;i&gt;drop&lt;/i&gt; from the stock with surprising &lt;b&gt;regularity&lt;/b&gt;.', '秩', '', 13, '2010-09-22 16:55:57', '2010-10-05 03:30:00', 13, 13),
(6227, 1, 812, 'It is my deepest &lt;b&gt;secret&lt;/b&gt;, that when looking for &lt;i&gt;cereal&lt;/i&gt;, I &lt;i&gt;invariably&lt;/i&gt; look for Luck Charms.', '秘', '', 10, '2010-09-17 05:26:17', '2010-09-27 03:30:00', 18, 17),
(6228, 1, 812, 'Someone &lt;i&gt;reclining&lt;/i&gt; on a &lt;i&gt;little&lt;/i&gt; cusion of &lt;i&gt;wheat&lt;/i&gt; is probably rich, successful, or well-known enough to have earned an &lt;b&gt;appelation&lt;/b&gt;.', '称', '', 13, '2010-09-22 16:56:55', '2010-10-05 03:30:00', 13, 13),
(6229, 1, 812, '&lt;b&gt;Profit&lt;/b&gt; is the money one makes, after costs.  Here we see in ancient japan, &lt;b&gt;profit&lt;/b&gt; was the &lt;i&gt;wheat&lt;/i&gt; had left after paying the &lt;i&gt;sabre&lt;/i&gt;&#039;d ruler of the land.', '利', '', 13, '2010-09-22 16:57:22', '2010-10-05 03:30:00', 13, 13),
(6230, 1, 812, 'Unlike the other &lt;i&gt;trees&lt;/i&gt; in the orchard, the &lt;b&gt;pear tree&lt;/b&gt; was planted purely for &lt;i&gt;profit&lt;/i&gt;.', '梨', '', 13, '2010-09-23 05:48:14', '2010-10-06 03:30:00', 13, 13),
(6231, 1, 812, 'When the &lt;i&gt;wheat&lt;/i&gt; is ready to be &lt;b&gt;harvested&lt;/b&gt;, it is put into large &lt;i&gt;vessels&lt;/i&gt;, and &lt;i&gt;flowers&lt;/i&gt; are attached identifying which village it came from.', '穫', '', 13, '2010-09-23 05:48:56', '2010-10-06 03:30:00', 13, 13),
(6232, 1, 812, 'In olden days, the &lt;b&gt;ear of a plant&lt;/b&gt;, particularly &lt;i&gt;wheat&lt;/i&gt; was used as a token to mark and count up &lt;i&gt;favours&lt;/i&gt;.', '穂', '', 13, '2010-09-23 05:49:32', '2010-10-06 03:30:00', 13, 13),
(6233, 1, 812, 'In &lt;i&gt;olden times&lt;/i&gt; japan had only &lt;i&gt;wheat&lt;/i&gt; as a cereal gorwing in her fields.  A &lt;i&gt;vulture&lt;/i&gt;, or other bird, took a &lt;b&gt;rice plant&lt;/b&gt; seed from korea, and dropped it in japan, thus starting the history of rice production in japan.', '稲', '', 13, '2010-09-23 05:48:42', '2010-10-06 03:30:00', 13, 13),
(6234, 1, 812, 'Fragrant &lt;b&gt;incense&lt;/b&gt; is sweer smelling, like &lt;i&gt;wheat&lt;/i&gt; in the &lt;i&gt;sun&lt;/i&gt;.', '香', '', 10, '2010-09-18 10:19:14', '2010-09-28 03:30:00', 18, 17),
(6235, 1, 812, 'As a &lt;i&gt;child&lt;/i&gt;, is is possible to run through the &lt;i&gt;wheat&lt;/i&gt; fields for three &lt;b&gt;seasons&lt;/b&gt; as the stalks grow.', '季', '', 9, '2010-09-17 05:27:04', '2010-09-26 03:30:00', 18, 17),
(6236, 1, 812, 'Being a matriarchical society, the &lt;b&gt;committee&lt;/b&gt; for distributing the village &lt;i&gt;wheat&lt;/i&gt; was full of &lt;i&gt;women&lt;/i&gt;.', '委', '', 13, '2010-09-23 05:48:25', '2010-10-06 03:30:00', 13, 13),
(6237, 1, 812, 'Pump your &lt;i&gt;fist&lt;/i&gt; in the air if you want to &lt;b&gt;excel&lt;/b&gt; at &lt;i&gt;wheat&lt;/i&gt; growing.', '秀', '', 13, '2010-09-23 05:49:07', '2010-10-06 03:30:00', 13, 13),
(6238, 1, 812, 'The kanji for &lt;b&gt;transparent&lt;/b&gt; comprises the elements &lt;i&gt;excel&lt;/i&gt; and &lt;i&gt;roadway&lt;/i&gt;.', '透', '', 13, '2010-09-23 05:49:17', '2010-10-06 03:30:00', 13, 13),
(6239, 1, 812, 'There are some &lt;i&gt;words&lt;/i&gt; which literally &lt;i&gt;excell&lt;/i&gt; at &lt;b&gt;enticing&lt;/b&gt; you to do something.  These words are usually used in marketing.', '誘', '', 13, '2010-09-23 05:49:49', '2010-10-06 03:30:00', 13, 13),
(6240, 1, 812, 'Instead of the &lt;s&gt;superfluous&lt;/s&gt; &lt;i&gt;husk&lt;/i&gt;, we&#039;re looking at the &lt;i&gt;crowned wheat&lt;/i&gt; of the &lt;b&gt;cereal&lt;/b&gt;.', '穀', '', 10, '2010-09-18 10:19:04', '2010-09-28 03:30:00', 18, 17),
(6241, 1, 812, 'Here we see a &lt;i&gt;wheat&lt;/i&gt; &lt;b&gt;germ&lt;/b&gt; being taken from a &lt;i&gt;flower&lt;/i&gt; and then &lt;i&gt;pent in&lt;/i&gt; for observation by bioligists.', '菌', '', 13, '2010-09-23 05:50:17', '2010-10-06 03:30:00', 13, 13),
(6242, 1, 812, 'This kanji is a pictograph of a number of grains of &lt;b&gt;rice&lt;/b&gt; lying on a plate in the shape of a star.', '米', '', 13, '2010-09-23 05:49:39', '2010-10-06 03:30:00', 13, 13),
(6243, 1, 812, 'If you split &lt;i&gt;rice&lt;/i&gt; into &lt;i&gt;parts&lt;/i&gt;, then you get a pretty sticky rice &lt;b&gt;flour&lt;/b&gt;.', '粉', '', 13, '2010-09-23 05:48:02', '2010-10-06 03:30:00', 13, 13),
(6244, 1, 812, 'If you use boiled &lt;i&gt;rice&lt;/i&gt; for &lt;i&gt;fortune telling&lt;/i&gt;, you could end up with a very &lt;b&gt;sticky&lt;/b&gt; fortune indeed!', '粘', '', 13, '2010-09-23 05:50:05', '2010-10-06 03:30:00', 13, 13),
(6245, 1, 812, 'Store the &lt;b&gt;grains&lt;/b&gt; of harvested &lt;i&gt;rice&lt;/i&gt; in a big &lt;i&gt;vase&lt;/i&gt; to hide it from the tax collector.', '粒', '', 13, '2010-09-25 11:18:18', '2010-10-08 03:30:00', 13, 13),
(6246, 1, 812, 'In ancient japan, ground &lt;i&gt;rice&lt;/i&gt;, and the &lt;i&gt;soil&lt;/i&gt; from dark, damp &lt;i&gt;caves&lt;/i&gt; were used as &lt;b&gt;cosmetics&lt;/b&gt;.', '粧', '', 13, '2010-09-25 11:17:43', '2010-10-08 03:30:00', 13, 13),
(6247, 1, 812, 'If you are travelling to Canada, taking the &lt;i&gt;road&lt;/i&gt; to the &lt;i&gt;United States&lt;/i&gt;, would see you gone &lt;b&gt;astray&lt;/b&gt;.', '迷', '', 13, '2010-09-25 11:19:24', '2010-10-08 03:30:00', 13, 13),
(6248, 1, 812, 'It&#039;s the latest trend, and very very &lt;b&gt;chic&lt;/b&gt; to play &lt;i&gt;cricket&lt;/i&gt; in a &lt;i&gt;ricefield&lt;/i&gt;, now.', '粋', '', 13, '2010-09-25 11:18:46', '2010-10-08 03:30:00', 13, 13),
(6249, 1, 812, 'A good &lt;i&gt;quantity&lt;/i&gt; of &lt;i&gt;rice&lt;/i&gt; should make it into your &lt;b&gt;provisions&lt;/b&gt;.', '糧', '', 9, '2010-09-19 09:08:56', '2010-09-28 03:30:00', 18, 17),
(6250, 1, 812, 'A bouquet of &lt;b&gt;chrysanthemum&lt;/b&gt; is usually &lt;i&gt;bound up&lt;/i&gt; with &lt;i&gt;rice&lt;/i&gt; and other &lt;i&gt;flowers&lt;/i&gt;, to round out the collection.', '菊', '', 13, '2010-09-25 11:17:29', '2010-10-08 03:30:00', 13, 13),
(6251, 1, 812, 'A &lt;i&gt;drop&lt;/i&gt; of brandy, in a &lt;i&gt;pent in&lt;/i&gt; store, full of &lt;i&gt;rice&lt;/i&gt; betrays the existence of a &lt;i&gt;St Berdanard Dog&lt;/i&gt; at the &lt;b&gt;core&lt;/b&gt; of this puzzle.', '奥', '', 13, '2010-09-25 11:16:34', '2010-10-08 03:30:00', 13, 13),
(6252, 1, 812, 'There were few things that were counted in ancient japan, and even fewer that were &lt;b&gt;numbered&lt;/b&gt;.  Each grain of &lt;i&gt;rice&lt;/i&gt; and each &lt;i&gt;woman&lt;/i&gt; got a &lt;b&gt;number&lt;/b&gt; from a dedicated &lt;i&gt;taskmaster&lt;/i&gt;.  What a lot of work!', '数', '', 13, '2010-09-25 11:16:56', '2010-10-08 03:30:00', 13, 13),
(6253, 1, 812, 'A &lt;i&gt;tree&lt;/i&gt; with a &lt;i&gt;woman&lt;/i&gt; at the top makes a pretty good, make-shift &lt;b&gt;watchtower&lt;/b&gt;.  When an enemy came, she could throw &lt;i&gt;rice&lt;/i&gt; at them from above.', '楼', '', 10, '2010-09-20 05:22:19', '2010-09-30 03:30:00', 18, 17),
(6254, 1, 812, 'Keeping track of the different &lt;b&gt;sorts&lt;/b&gt; of &lt;i&gt;rice&lt;/i&gt; and &lt;i&gt;big dogs&lt;/i&gt; available in Japan will make your &lt;i&gt;head&lt;/i&gt; hurt.', '類', '', 13, '2010-09-25 11:18:01', '2010-10-08 03:30:00', 13, 13),
(6255, 1, 812, 'When adding &lt;i&gt;watery&lt;/i&gt; &lt;b&gt;lacquer&lt;/b&gt; to a &lt;i&gt;tree&lt;/i&gt;, remember to put up &lt;i&gt;umbrellas&lt;/i&gt; on the surrounding &lt;i&gt;grains of rice&lt;/i&gt; to protect them from the &lt;b&gt;lacquer&lt;/b&gt; paint.', '漆', '', 12, '2010-09-19 09:08:18', '2010-10-01 03:30:00', 16, 15),
(6256, 1, 812, 'This is &lt;b&gt;Esq.&lt;/b&gt;, or sama, the most polite form of address.  People who get the &lt;b&gt;Esq.&lt;/b&gt; are normally pretty rich, and own, at the very least, one &lt;i&gt;tree&lt;/i&gt;, one &lt;i&gt;sheep&lt;/i&gt;, and one &lt;i&gt;grain of rice&lt;/i&gt;.', '様', '', 13, '2010-09-25 11:19:07', '2010-10-08 03:30:00', 13, 13),
(6257, 1, 812, 'When making &lt;b&gt;requests&lt;/b&gt; to the gods, the japanese would put a &lt;i&gt;drop&lt;/i&gt; of blood on &lt;i&gt;needle&lt;/i&gt; and send it down into a body of &lt;i&gt;water&lt;/i&gt;, to accompany your &lt;b&gt;request&lt;/b&gt;.', '求', '', 13, '2010-09-25 11:16:09', '2010-10-08 03:30:00', 13, 13),
(6258, 1, 812, 'The full character for &lt;b&gt;ball&lt;/b&gt; shows a &lt;i&gt;ball&lt;/i&gt; and a &lt;i&gt;request&lt;/i&gt;, reminding us of the common phrase &quot;Can I have my ball back, mister?&quot;.', '球', '', 13, '2010-09-25 11:17:10', '2010-10-08 03:30:00', 13, 13),
(6259, 1, 812, 'The kanji for &lt;b&gt;salvation&lt;/b&gt; shows someone making a &lt;i&gt;request&lt;/i&gt; to the heavenly &lt;i&gt;taskmaster&lt;/i&gt;.', '救', '', 12, '2010-09-19 09:08:30', '2010-10-01 03:30:00', 16, 15),
(6260, 1, 812, '&lt;b&gt;Bamboo&lt;/b&gt; grows upwards, like a straight &lt;i&gt;nail&lt;/i&gt;, and at each stage of its growth, there is a jointed rootstock (the firs stroke).  Two suchh &lt;b&gt;bamboo&lt;/b&gt; stalks are pictured here.', '竹', '', 12, '2010-09-14 05:56:39', '2010-09-26 03:30:00', 12, 12),
(6261, 1, 812, 'When we &lt;b&gt;laugh&lt;/b&gt;, hollow stalks of &lt;i&gt;bamboo&lt;/i&gt; bring our &lt;b&gt;laughter&lt;/b&gt; up to the &lt;i&gt;heavens&lt;/i&gt; for the gods to enjoy.', '笑', '', 13, '2010-09-20 05:22:28', '2010-10-03 03:30:00', 13, 13),
(6262, 1, 812, 'This kanji, for a &lt;b&gt;bamboo hat&lt;/b&gt; shows two stocks of &lt;i&gt;bamboo&lt;/i&gt; on top of a &lt;i&gt;vase&lt;/i&gt;.  You really shouldn&#039;t use your &lt;i&gt;vase&lt;/i&gt; as a &lt;b&gt;bamboo hat&lt;/b&gt;-stand.', '笠', '', 12, '2010-09-14 05:53:48', '2010-09-26 03:30:00', 12, 12),
(6263, 1, 812, '&lt;b&gt;Bamboo grass&lt;/b&gt;, unlik &lt;i&gt;bamboo&lt;/i&gt;, grows so slowly that it takes a &lt;i&gt;generation&lt;/i&gt; to see the results.', '笹', '', 12, '2010-09-14 05:57:02', '2010-09-26 03:30:00', 12, 12),
(6264, 1, 812, 'The &lt;i&gt;part of the body&lt;/i&gt; which has the &lt;i&gt;power&lt;/i&gt; and strength of &lt;i&gt;bamboo&lt;/i&gt;?  That&#039;s your &lt;b&gt;muscles&lt;/b&gt;.', '筋', '', 11, '2010-09-24 20:27:54', '2010-10-05 03:30:00', 18, 17),
(6265, 1, 812, 'For carrying things between regions, or &lt;i&gt;inter&lt;i&gt;-reginally, what could be more appropriate than a &lt;i&gt;bamboo&lt;/i&gt; box?', '箱', '', 12, '2010-09-14 05:51:46', '2010-09-26 03:30:00', 12, 12),
(6266, 1, 812, 'Contrary to popular belief, the &lt;i&gt;brush&lt;/i&gt; known as a &lt;b&gt;writing brush&lt;/b&gt; is in fact made from &lt;i&gt;bamboo&lt;/i&gt;.', '筆', '', 12, '2010-09-14 05:52:15', '2010-09-26 03:30:00', 12, 12),
(6267, 1, 812, 'The one thing about &lt;i&gt;bamboo&lt;/i&gt; that is the &lt;i&gt;same&lt;/i&gt; across the board is the shape: that of a &lt;b&gt;cyllinder&lt;/b&gt;.', '筒', '', 14, '2010-09-24 20:27:27', '2010-10-08 03:30:00', 14, 14),
(6268, 1, 812, 'The kanji for &lt;b&gt;etc.&lt;/b&gt; contains &lt;i&gt;bamboo&lt;/i&gt; and a &lt;i&gt;buddhist temple&lt;/i&gt;.', '等', '', 12, '2010-09-14 05:56:20', '2010-09-26 03:30:00', 12, 12),
(6269, 1, 812, 'Imagine an old abacus, made from &lt;i&gt;bamboo&lt;/i&gt;.  You still need &lt;i&gt;eyes&lt;/i&gt; and &lt;i&gt;two hands&lt;/i&gt; to work it, but it will help you &lt;b&gt;calculate&lt;/b&gt; just as good as a modern abacus can.', '算', '', 12, '2010-09-14 05:52:01', '2010-09-26 03:30:00', 12, 12),
(6270, 1, 812, 'The &lt;b&gt;solution&lt;/b&gt;, as always from he &lt;i&gt;bamboo&lt;/i&gt; salesman, was to find some way of &lt;i&gt;fitting bamboo&lt;/i&gt; into the problem area.', '答', '', 12, '2010-09-14 05:53:35', '2010-09-26 03:30:00', 12, 12),
(6271, 1, 812, 'As a &lt;b&gt;scheme&lt;/b&gt; to grow &lt;i&gt;bamboo&lt;/i&gt;, putting &lt;i&gt;belts&lt;/i&gt; on a &lt;i&gt;tree&lt;/i&gt; simply wasn&#039;t working.', '策', '', 9, '2010-09-18 10:18:48', '2010-09-27 03:30:00', 20, 19),
(6272, 1, 812, 'Every &lt;i&gt;acupuncturist&lt;/i&gt; must &lt;b&gt;register&lt;/b&gt; the &lt;i&gt;bamboo&lt;/i&gt; they use for puncturing, and the &lt;i&gt;water&lt;/i&gt; they use to clean the needles with.', '簿', '', 12, '2010-09-14 05:56:08', '2010-09-26 03:30:00', 12, 12),
(6273, 1, 812, 'An ancient japanese factory, using &lt;i&gt;bamboo&lt;/i&gt;, &lt;i&gt;wood&lt;/i&gt;, and its &lt;i&gt;mediocre craft&lt;/i&gt; facilities, &lt;b&gt;fabricate&lt;/b&gt; ancient japanese mass produced trinkets.', '築', '', 12, '2010-09-14 05:52:51', '2010-09-26 03:30:00', 12, 12),
(6274, 1, 813, 'The character for &lt;i&gt;enter&lt;/i&gt; showed someone walking inwards.  The one for &lt;b&gt;person&lt;/b&gt;, shown here, represents someone walking outwards.', '人', '', 12, '2010-09-15 05:38:34', '2010-09-27 03:30:00', 12, 12),
(6275, 1, 813, 'The &lt;i&gt;person&lt;/i&gt; at many a rich man&#039;s &lt;i&gt;left&lt;/i&gt; is his &lt;b&gt;assistant&lt;/b&gt;.', '佐', '', 12, '2010-09-15 05:39:19', '2010-09-27 03:30:00', 12, 12),
(6276, 1, 813, 'A &lt;i&gt;person&lt;/i&gt;, having slept on his thoughts until &lt;i&gt;nightbreak&lt;/i&gt;, may begin his next thought with the word &lt;b&gt;however&lt;/b&gt;.', '但', '', 12, '2010-09-15 05:40:06', '2010-09-27 03:30:00', 12, 12),
(6277, 1, 813, 'It&#039;s always good advice for a &lt;i&gt;person&lt;/i&gt; to not sit at a table with a &lt;i&gt;candlestick&lt;/i&gt;, &lt;b&gt;dwelling&lt;/b&gt; on the flame.', '住', '', 12, '2010-09-15 05:39:30', '2010-09-27 03:30:00', 12, 12),
(6278, 1, 813, 'When everyone else is seated, the &lt;i&gt;person standing up&lt;/i&gt; usually pulls the highest &lt;b&gt;rank&lt;/b&gt;.', '位', '', 12, '2010-09-15 05:37:54', '2010-09-27 03:30:00', 12, 12),
(6279, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; in the &lt;i&gt;middle&lt;/i&gt; is usually called &lt;b&gt;go-between&lt;/b&gt;.', '仲', '', 12, '2010-09-15 05:40:14', '2010-09-27 03:30:00', 12, 12),
(6280, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; who appears often in &lt;i&gt;books&lt;/i&gt;, especially in the genre crime, is very often identified only as a &lt;b&gt;body&lt;/b&gt;.', '体', '', 12, '2010-09-15 05:37:43', '2010-09-27 03:30:00', 12, 12),
(6281, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; with a &lt;i&gt;walking stick&lt;/i&gt; who is &lt;b&gt;remote&lt;/b&gt; from his &lt;i&gt;taskmaster&lt;/i&gt; has a big &lt;i&gt;heart&lt;/i&gt; full of happiness at being so &lt;b&gt;remote&lt;/b&gt;.', '悠', '', 12, '2010-09-15 05:38:51', '2010-09-27 03:30:00', 12, 12),
(6282, 1, 813, 'Any &lt;i&gt;person&lt;/i&gt; getting into bed with an ugly old &lt;i&gt;cow&lt;/i&gt; must be really desperate to have an &lt;b&gt;affair&lt;/b&gt;.', '件', '', 12, '2010-09-15 05:39:08', '2010-09-27 03:30:00', 12, 12),
(6283, 1, 813, 'The &lt;i&gt;person&lt;/i&gt; beside a &lt;i&gt;samurai&lt;/i&gt; is he who &lt;b&gt;attends&lt;/b&gt; and serves him.', '仕', '', 12, '2010-09-15 05:38:59', '2010-09-27 03:30:00', 12, 12),
(6284, 1, 813, 'Between a &lt;i&gt;person&lt;/i&gt; and a &lt;i&gt;scorpion&lt;/i&gt;, I&#039;m sure I&#039;d pick the &lt;b&gt;other&lt;/b&gt; one.', '他', '', 12, '2010-09-15 05:38:01', '2010-09-27 03:30:00', 12, 12),
(6285, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; who wants to pet a &lt;i&gt;chihuahua&lt;/i&gt;, will end up &lt;b&gt;prostrated&lt;/b&gt;.', '伏', '', 12, '2010-09-15 05:39:38', '2010-09-27 03:30:00', 12, 12),
(6286, 1, 813, 'American indians would &lt;b&gt;transmit&lt;/b&gt; signals from one &lt;i&gt;person&lt;/i&gt; to another using &lt;i&gt;rising clouds&lt;/i&gt; of smoke.', '伝', '', 12, '2010-09-15 05:38:09', '2010-09-27 03:30:00', 12, 12),
(6287, 1, 813, 'To help make moral decisions, every &lt;i&gt;person&lt;/i&gt; should have a little &lt;b&gt;Buddha&lt;/b&gt; at his &lt;i&gt;elbow&lt;/i&gt;.', '仏', '', 12, '2010-09-16 05:32:06', '2010-09-28 03:30:00', 12, 12),
(6288, 1, 813, 'The kanji for &lt;b&gt;rest&lt;/b&gt; shows a &lt;i&gt;person&lt;/i&gt; leaning against a &lt;i&gt;tree&lt;/i&gt;.', '休', '', 12, '2010-09-16 05:31:58', '2010-09-28 03:30:00', 12, 12),
(6289, 1, 813, 'The &lt;i&gt;person&lt;/i&gt; who lead the &lt;i&gt;anti-&lt;/i&gt;government protests is usually made into the &lt;b&gt;provisional&lt;/b&gt; presdient or some such.', '仮', '', 12, '2010-09-16 05:29:56', '2010-09-28 03:30:00', 12, 12),
(6290, 1, 813, 'The &lt;i&gt;person&lt;i&gt; with the &lt;i&gt;whitest&lt;/i&gt; record gets to be the &lt;b&gt;chief&lt;/b&gt; of staff at the White House.', '伯', '', 12, '2010-09-16 05:30:26', '2010-09-28 03:30:00', 12, 12),
(6291, 1, 813, 'It is the provence of the &lt;b&gt;vulgar&lt;/b&gt; &lt;i&gt;persons&lt;/i&gt; to have a cottage in the &lt;i&gt;valley&lt;/i&gt;.', '俗', '', 12, '2010-09-16 05:30:56', '2010-09-28 03:30:00', 12, 12),
(6292, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; who believes in the &lt;i&gt;word&lt;/i&gt; of God is said to have &lt;b&gt;faith&lt;/b&gt;.', '信', '', 12, '2010-09-16 05:31:07', '2010-09-28 03:30:00', 12, 12),
(6293, 1, 813, 'An evil genius has trapped yet another &lt;i&gt;person&lt;/i&gt; in his monster-&lt;i&gt;ivy&lt;/i&gt; plant.  What does he say to that?  &lt;b&gt;Excellent&lt;/b&gt;.', '佳', '', 12, '2010-09-16 05:32:15', '2010-09-28 03:30:00', 12, 12),
(6294, 1, 813, 'I, like most &lt;i&gt;persons&lt;/i&gt;, am quite &lt;b&gt;reliant&lt;/b&gt; on &lt;i&gt;garments&lt;/i&gt; to hide my shame.', '依', '', 12, '2010-09-16 05:30:13', '2010-09-28 03:30:00', 12, 12);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(6295, 1, 813, 'In a &lt;i&gt;file&lt;/i&gt; of people, a single &lt;i&gt;person&lt;/i&gt; can be considered to be an &lt;b&gt;example&lt;/b&gt;.', '例', '', 12, '2010-09-16 05:31:49', '2010-09-28 03:30:00', 12, 12),
(6296, 1, 813, 'When a &lt;i&gt;person&#039;s&lt;/i&gt; personality &lt;i&gt;hardens&lt;/i&gt;, he goes from being part of the crowd, to becoming an &lt;b&gt;individual&lt;/b&gt;.', '個', '', 12, '2010-09-16 05:29:42', '2010-09-28 03:30:00', 12, 12),
(6297, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; with a good &lt;i&gt;build&lt;/i&gt; is very &lt;b&gt;healthy&lt;/b&gt; indeed.', '健', '', 12, '2010-09-16 05:31:30', '2010-09-28 03:30:00', 12, 12),
(6298, 1, 813, 'When &lt;i&gt;ruling&lt;/i&gt; up a &lt;i&gt;person&lt;/i&gt;, to get the height of him or her, the measuring tape should be place at their &lt;b&gt;side&lt;/b&gt;.', '側', '', 12, '2010-09-16 05:31:18', '2010-09-28 03:30:00', 12, 12),
(6299, 1, 813, 'Just as &lt;i&gt;wait&lt;/i&gt; shows a line of people at a &lt;i&gt;buddhist temple&lt;/i&gt;, here we pick out one &lt;i&gt;person&lt;/i&gt;, who we will call a &lt;b&gt;waiter&lt;/b&gt;.', '侍', '', 12, '2010-09-16 05:30:35', '2010-09-28 03:30:00', 12, 12),
(6300, 1, 813, 'The bouncers received orders to &lt;b&gt;halt&lt;/b&gt; every &lt;i&gt;person&lt;/i&gt; trying to enter the &lt;i&gt;pavilion&lt;/i&gt;, and demand five pounds.', '停', '', 12, '2010-09-17 05:30:31', '2010-09-29 03:30:00', 12, 12),
(6301, 1, 813, 'When you get a good &lt;b&gt;price&lt;/b&gt;, and &lt;i&gt;person&lt;/i&gt; would pay it &lt;i&gt;straightaway&lt;/i&gt;.', '値', '', 12, '2010-09-17 05:29:23', '2010-09-29 03:30:00', 12, 12),
(6302, 1, 813, 'The kanji for &lt;b&gt;emulate&lt;/b&gt; shows a &lt;i&gt;person set free&lt;/i&gt; from &lt;b&gt;emulation&lt;/b&gt;.', '倣', '', 12, '2010-09-17 05:30:42', '2010-09-29 03:30:00', 12, 12),
(6303, 1, 813, 'The &lt;i&gt;arrival&lt;/i&gt; of a most important &lt;i&gt;person&lt;/i&gt; in the capital city can lead to the government being &lt;b&gt;overthrown&lt;/b&gt;.', '倒', '', 10, '2010-09-17 05:31:19', '2010-09-27 03:30:00', 17, 16),
(6304, 1, 813, '&lt;b&gt;Spys&lt;/b&gt; are so good at &lt;b&gt;spying&lt;/b&gt; that they cannot be distinguished from any other &lt;i&gt;upright person&lt;/i&gt;.', '偵', '', 12, '2010-09-17 05:30:11', '2010-09-29 03:30:00', 12, 12),
(6305, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; whose job is to &lt;i&gt;increase&lt;/i&gt; the faith in others, is, in japan, a &lt;b&gt;Buddhist priest&lt;/b&gt;.', '僧', '', 12, '2010-09-17 05:28:10', '2010-09-29 03:30:00', 12, 12),
(6306, 1, 813, 'The kanji for &lt;b&gt;hundred million&lt;/b&gt; shows two things in this world there are a &lt;b&gt;hundred million&lt;/b&gt; of: &lt;i&gt;persons&lt;/i&gt; and &lt;i&gt;ideas&lt;/i&gt;.', '億', '', 12, '2010-09-17 05:28:36', '2010-09-29 03:30:00', 12, 12),
(6307, 1, 813, 'A &lt;b&gt;ceremony&lt;/b&gt; celebrates &lt;i&gt;persons&lt;/i&gt; of great &lt;i&gt;righteousness&lt;/i&gt;.', '儀', '', 12, '2010-09-17 05:31:08', '2010-09-29 03:30:00', 12, 12),
(6308, 1, 813, '&lt;b&gt;Reparations&lt;/b&gt; are seen by some as a &lt;i&gt;prize&lt;/i&gt; for a traumatised &lt;i&gt;person&lt;/i&gt;.', '償', '', 12, '2010-09-17 05:28:00', '2010-09-29 03:30:00', 12, 12),
(6309, 1, 813, 'This kanji is brilliantly simple: a &lt;i&gt;person&lt;/i&gt; in the &lt;i&gt;mountains&lt;/i&gt;, also known as a &lt;b&gt;hermit&lt;/b&gt;.', '仙', '', 12, '2010-09-17 05:30:00', '2010-09-29 03:30:00', 12, 12),
(6310, 1, 813, 'The most important sport for &lt;i&gt;hermits&lt;/i&gt; is &lt;i&gt;turkey&lt;/i&gt; racing, which takes in a huge amount of money in &lt;b&gt;sponsors&lt;/b&gt;.', '催', '', 12, '2010-09-17 05:30:53', '2010-09-29 03:30:00', 12, 12),
(6311, 1, 813, 'To refer to the fullness of &lt;b&gt;humanity&lt;/b&gt; that can only be achieved in dialogue with another (&lt;i&gt;person ... two&lt;/i&gt;), Confucius used this character.', '仁', '', 12, '2010-09-17 05:28:22', '2010-09-29 03:30:00', 12, 12),
(6312, 1, 813, 'If you are particularly mean, you might just view &lt;i&gt;every person&lt;/i&gt; with absolute &lt;b&gt;scorn&lt;/b&gt;.', '侮', '', 12, '2010-09-17 05:29:08', '2010-09-29 03:30:00', 12, 12),
(6313, 1, 813, 'To the ordinary &lt;i&gt;person&lt;/i&gt;, lost in Tokyo, a police &lt;i&gt;officer&lt;/i&gt; is of immediate &lt;b&gt;use&lt;/b&gt;.', '使', '', 12, '2010-09-19 09:18:28', '2010-10-01 03:30:00', 12, 12),
(6314, 1, 813, 'Every &lt;i&gt;person&lt;/i&gt; out on a drinking binge, as time &lt;i&gt;grows late&lt;/i&gt;, makes a visit to a &lt;b&gt;convenience&lt;/b&gt;, both the store and the toilet.', '便', '', 12, '2010-09-19 09:14:10', '2010-10-01 03:30:00', 12, 12),
(6315, 1, 813, 'If a &lt;i&gt;person&lt;/i&gt; made a &lt;b&gt;double&lt;/b&gt; of themselves, then they&#039;d need to use a &lt;i&gt;muzzle&lt;/i&gt; to keep one of them quiet.', '倍', '', 12, '2010-09-19 09:15:21', '2010-10-01 03:30:00', 12, 12),
(6316, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; who suffers from &lt;i&gt;melancholy&lt;/i&gt; can be said to have a soul of &lt;b&gt;tenderness&lt;/b&gt;.', '優', '', 12, '2010-09-19 09:15:40', '2010-10-01 03:30:00', 12, 12),
(6317, 1, 813, 'Every year, a &lt;i&gt;person&lt;/i&gt; is chosen to &lt;b&gt;fell&lt;/b&gt; a tree in the tree &lt;b&gt;felling&lt;/b&gt; &lt;i&gt;fiesta&lt;/i&gt;.', '伐', '', 12, '2010-09-19 09:12:41', '2010-10-01 03:30:00', 12, 12),
(6318, 1, 813, 'A &lt;i&gt;house&lt;/i&gt; that can take &lt;i&gt;one hundred persons&lt;/i&gt; we would call an &lt;b&gt;inn&lt;/b&gt;.', '宿', '', 12, '2010-09-19 09:11:31', '2010-10-01 03:30:00', 12, 12),
(6319, 1, 813, 'A &lt;i&gt;person&lt;/i&gt; with a bad &lt;b&gt;wound&lt;/b&gt; will spend some time &lt;i&gt;reclining&lt;/i&gt; beside his &lt;i&gt;piggy bank&lt;/i&gt;, counting up his money to see if he can afford to see the doctor.', '傷', '', 12, '2010-09-19 09:14:56', '2010-10-01 03:30:00', 12, 12),
(6320, 1, 813, 'Secret ninjas &lt;b&gt;protect&lt;/b&gt; and important &lt;i&gt;person&lt;/i&gt;, by hiding in &lt;i&gt;trees&lt;/i&gt;.  All that can be seen of them is their &lt;i&gt;mouth&lt;/i&gt; at the top of said &lt;i&gt;trees&lt;/i&gt;.', '保', '', 12, '2010-09-19 09:16:31', '2010-10-01 03:30:00', 12, 12),
(6321, 1, 813, 'Those who are best at &lt;i&gt;protecting&lt;/i&gt; get to wear a special &lt;i&gt;top hat and scarf&lt;/i&gt;, as &lt;b&gt;praise&lt;/b&gt; for their contributions.', '褒', '', 9, '2010-09-25 11:20:06', '2010-10-04 03:30:00', 18, 17),
(6322, 1, 813, 'True &lt;b&gt;greatness&lt;/b&gt; is posessed by the &lt;i&gt;person&lt;/i&gt; who can pull off a combination of &lt;i&gt;sunglasses&lt;/i&gt; and a &lt;i&gt;tree&lt;/i&gt;.', '傑', '', 9, '2010-09-17 05:29:51', '2010-09-26 03:30:00', 17, 16),
(6323, 1, 813, 'A &lt;i&gt;person glued to&lt;/i&gt; a certain path is said to &lt;i&gt;adhere&lt;/i&gt; to it.', '付', '', 12, '2010-09-19 09:14:21', '2010-10-01 03:30:00', 12, 12),
(6324, 1, 813, 'In the Imperial Gardens in Tokyo, it is very important that you &lt;i&gt;adhere&lt;/i&gt; to your &lt;i&gt;bamboo&lt;/i&gt; &lt;b&gt;token&lt;/b&gt;, as that is used to count you in and out.', '符', '', 12, '2010-09-19 09:19:49', '2010-10-01 03:30:00', 12, 12),
(6325, 1, 813, 'Every &lt;b&gt;municipality&lt;/b&gt; in japan is situated so close to a &lt;i&gt;cave&lt;/i&gt;, that you might say that they are &lt;b&gt;adhered&lt;/b&gt; to them.', '府', '', 12, '2010-09-19 09:16:00', '2010-10-01 03:30:00', 12, 12),
(6326, 1, 813, 'The &lt;i&gt;porter&lt;/i&gt; is the &lt;i&gt;person&lt;/i&gt; who takes &lt;b&gt;responsibility&lt;/b&gt; for your bags.', '任', '', 12, '2010-09-19 09:19:35', '2010-10-01 03:30:00', 12, 12),
(6327, 1, 813, 'Having the right &lt;i&gt;money&lt;/i&gt; for the &lt;b&gt;fare&lt;/b&gt; is the passengers &lt;i&gt;responsibility&lt;/i&gt;.', '賃', '', 12, '2010-09-19 09:18:08', '2010-10-01 03:30:00', 12, 12),
(6328, 1, 813, 'William Tell, the most famous &lt;i&gt;person&lt;/i&gt; to shoot an &lt;i&gt;arrow&lt;/i&gt;, surely hoped to find a &lt;b&gt;substitute&lt;/b&gt; for his son.', '代', '', 12, '2010-09-19 09:15:08', '2010-10-01 03:30:00', 12, 12),
(6329, 1, 813, 'A &lt;b&gt;sack&lt;/b&gt; is deffinitely merely a &lt;i&gt;substitute garment&lt;/i&gt;.', '袋', '', 12, '2010-09-19 09:13:26', '2010-10-01 03:30:00', 12, 12),
(6330, 1, 813, 'Someone who needs the &lt;b&gt;lend&lt;/b&gt; of something, needs essentially what is &lt;i&gt;substitute money&lt;/i&gt;.', '貸', '', 12, '2010-09-19 09:19:24', '2010-10-01 03:30:00', 12, 12),
