(6395, 1, 815, 'Like in many fairytales in the west, there is one in japan about a beuatiful &lt;i&gt;water&lt;/i&gt;-creature who plays a &lt;i&gt;shakuhachi&lt;/i&gt; flute to lure you into her &lt;b&gt;swamp&lt;/b&gt;.', '沢', '', 12, '2010-09-24 20:36:34', '2010-10-06 03:30:00', 12, 12),
(6396, 1, 815, '&lt;i&gt;Words&lt;/i&gt; flowing through a magical &lt;i&gt;shakuhachi&lt;/i&gt; pipe are automatically &lt;b&gt;translated&lt;/b&gt; into whichever language is required.', '訳', '', 11, '2010-09-15 05:42:10', '2010-09-26 03:30:00', 11, 11),
(6397, 1, 815, 'To make the right note on a &lt;i&gt;shakuhachi&lt;/i&gt;, your &lt;i&gt;fingers&lt;/i&gt; must cover the right holes, so make sure to &lt;b&gt;choose&lt;/b&gt; correctly.', '択', '', 11, '2010-09-15 05:41:15', '2010-09-26 03:30:00', 11, 11),
(6398, 1, 815, 'What follows &lt;i&gt;nightbreak&lt;/i&gt; and is marked by the playing of a &lt;i&gt;shakuhachi&lt;/i&gt;-flute?  The &lt;b&gt;daytime&lt;/b&gt; flute-practice, of course.', '昼', '', 11, '2010-09-15 05:41:35', '2010-09-26 03:30:00', 11, 11),
(6399, 1, 815, 'In ancient japan, and in many traditional japanese restaurants, the &lt;b&gt;door&lt;/b&gt; is little more than a &lt;i&gt;flag&lt;/i&gt; reaching the &lt;i&gt;ceiling&lt;/i&gt;.', '戸', '', 11, '2010-09-15 05:43:10', '2010-09-26 03:30:00', 11, 11),
(6400, 1, 815, 'The first &lt;i&gt;part of the body&lt;/i&gt; to go through the &lt;i&gt;door&lt;/i&gt; is often the &lt;b&gt;shoulders&lt;/b&gt;.', '肩', '', 11, '2010-09-15 05:43:42', '2010-09-26 03:30:00', 11, 11),
(6401, 1, 815, 'The ancient japanese used the &lt;b&gt;tassels&lt;/b&gt; on the &lt;i&gt;door&lt;/i&gt; as a sort of &lt;i&gt;compass&lt;/i&gt;, showing the way inside.', '房', '', 11, '2010-09-15 05:41:59', '2010-09-26 03:30:00', 11, 11),
(6402, 1, 815, 'If the &lt;i&gt;door&lt;/i&gt; had &lt;i&gt;wings&lt;/i&gt;, then we wouldn&#039;t need to buy a &lt;b&gt;fan&lt;/b&gt;.', '扇', '', 11, '2010-09-15 05:43:31', '2010-09-26 03:30:00', 11, 11),
(6403, 1, 815, 'The &lt;b&gt;hearth&lt;/b&gt; is made of two components: &lt;i&gt;hearthfire&lt;/i&gt; and a &lt;i&gt;door&lt;/i&gt;, for letting the smoke away.', '炉', '', 10, '2010-09-21 17:31:45', '2010-10-01 03:30:00', 18, 16),
(6404, 1, 815, 'A &lt;i&gt;St Bernard dog&lt;/i&gt;, no matter where it is let loose, will always &lt;b&gt;re&lt;/b&gt;turn to his master&#039;s &lt;i&gt;door&lt;/i&gt;.', '戻', '', 11, '2010-09-15 05:41:25', '2010-09-26 03:30:00', 11, 11),
(6405, 1, 815, 'Those little drops of &lt;i&gt;water&lt;/i&gt; that come back and &lt;i&gt;re&lt;/i&gt;turn, again and again, are drops of &lt;b&gt;tears&lt;/b&gt;.', '涙', '', 11, '2010-09-15 05:43:00', '2010-09-26 03:30:00', 11, 11),
(6406, 1, 815, 'When a manager shows a &lt;i&gt;turkey&lt;/i&gt; the &lt;i&gt;door&lt;/i&gt;, it&#039;s usually because he&#039;s found someone better to &lt;b&gt;employ&lt;/b&gt;.', '雇', '', 11, '2010-09-15 05:41:46', '2010-09-26 03:30:00', 11, 11),
(6407, 1, 815, 'I once &lt;i&gt;employed&lt;/i&gt; a &lt;i&gt;head&lt;/i&gt;, but it needed constant supervision, so it kept on &lt;b&gt;looking back&lt;/b&gt; for me.', '顧', '', 11, '2010-09-15 05:41:05', '2010-09-26 03:30:00', 11, 11),
(6408, 1, 815, 'At the &lt;i&gt;door&lt;/i&gt;, the &lt;i&gt;taskmaster&lt;/i&gt; is free to open his &lt;i&gt;mouth&lt;/i&gt; and &lt;b&gt;disclose&lt;/b&gt; the most secret of information.', '啓', '', 11, '2010-09-15 05:43:20', '2010-09-26 03:30:00', 11, 11),
(6409, 1, 816, 'Although the elements &lt;i&gt;two&lt;/i&gt; and &lt;i&gt;little&lt;/i&gt; are available for using, it may be easier to remember this character as a picture of an altar.  Something placed atop the altar is put on &lt;b&gt;show&lt;/b&gt; for all to see.', '示', '', 11, '2010-09-16 05:34:51', '2010-09-27 03:30:00', 11, 11),
(6410, 1, 816, 'This keyword refers to the polite bows and ceremonious forms of &lt;b&gt;salutation&lt;/b&gt; so important in Japanese culture.  In order to give the correct &lt;b&gt;salutation&lt;/b&gt;, you must imagine that you are bowing before an &lt;i&gt;altar&lt;/i&gt; with a &lt;i&gt;fishhook&lt;/i&gt; dragging you further and further down.', '礼', '', 11, '2010-09-16 05:35:59', '2010-09-27 03:30:00', 11, 11),
(6411, 1, 816, 'Sacrificing a &lt;i&gt;sheep&lt;/i&gt; on the &lt;i&gt;alter&lt;/i&gt; is not enough for an &lt;b&gt;auspicious&lt;/b&gt; day.  Next time, bring an elephant!', '祥', '', 11, '2010-09-16 05:36:12', '2010-09-27 03:30:00', 11, 11),
(6412, 1, 816, 'At confimation, &lt;i&gt;teenagers&lt;/i&gt; come before the &lt;i&gt;alter&lt;/i&gt; and &lt;b&gt;celebrate&lt;/b&gt; communion for the first time.', '祝', '', 11, '2010-09-16 05:36:25', '2010-09-27 03:30:00', 11, 11),
(6413, 1, 816, 'The &lt;i&gt;wealth&lt;/i&gt; laid out on the &lt;i&gt;altar&lt;/i&gt; is a good indication of a large &lt;b&gt;blessing&lt;/b&gt;.', '福', '', 11, '2010-09-16 05:35:50', '2010-09-27 03:30:00', 11, 11),
(6414, 1, 816, '&lt;i&gt;Stopping&lt;/i&gt; by the &lt;i&gt;altar&lt;/i&gt; is good for your spiritual &lt;b&gt;welfare&lt;/b&gt;.', '祉', '', 11, '2010-09-16 05:36:36', '2010-09-27 03:30:00', 11, 11),
(6415, 1, 816, 'A &lt;b&gt;company&lt;/b&gt; on the lookout for a good place to build a new headquarters will pray at an &lt;i&gt;altar&lt;/i&gt; of &lt;i&gt;soil&lt;/i&gt;.', '社', '', 11, '2010-09-16 05:36:48', '2010-09-27 03:30:00', 11, 11),
(6416, 1, 816, 'When the highest priest in the land wants to &lt;i&gt;see&lt;/i&gt; your &lt;i&gt;altar&lt;/i&gt;, it&#039;s usually because it requires an annual &lt;b&gt;inspection&lt;/b&gt;.', '視', '', 11, '2010-09-16 05:34:30', '2010-09-27 03:30:00', 11, 11),
(6417, 1, 816, 'An &lt;i&gt;altar&lt;/i&gt; with a &lt;i&gt;big dog&lt;/i&gt; is only to be found in Japan&#039;s oldest capital, and spiritual homeland, the city of &lt;b&gt;Nara&lt;/b&gt;.', '奈', '', 11, '2010-09-16 05:34:39', '2010-09-27 03:30:00', 11, 11),
(6418, 1, 816, 'There are no atheists in foxholes, so goes the saying, which explains why the character containing a &lt;i&gt;flag&lt;/i&gt;, an &lt;i&gt;altar&lt;/i&gt;, and &lt;i&gt;glue&lt;/i&gt; is that of a &lt;b&gt;military officer&lt;/b&gt;.', '尉', '', 11, '2010-09-16 05:33:58', '2010-09-27 03:30:00', 11, 11),
(6419, 1, 816, 'Even the hardest &lt;i&gt;military officer&lt;/i&gt; has the &lt;i&gt;heart&lt;/i&gt; to offer you some &lt;b&gt;consolation&lt;/b&gt;.', '慰', '', 10, '2010-09-16 05:35:07', '2010-09-26 03:30:00', 15, 14),
(6420, 1, 816, 'A &lt;i&gt;samurai&lt;/i&gt; at the &lt;i&gt;altar&lt;/i&gt; has no &lt;i&gt;lack&lt;/i&gt; of &lt;b&gt;goodwill&lt;/b&gt;.', '款', '', 9, '2010-09-25 11:21:34', '2010-10-04 03:30:00', 17, 16),
(6421, 1, 816, 'There are &lt;i&gt;groves&lt;/i&gt; with &lt;i&gt;altars&lt;/i&gt; in them due to the &lt;b&gt;prohibition&lt;/b&gt; of certain religions.', '禁', '', 11, '2010-09-16 05:34:14', '2010-09-27 03:30:00', 11, 11),
(6422, 1, 816, 'The current fashion has &lt;i&gt;prohibition&lt;/i&gt; against a &lt;i&gt;cloak&lt;/i&gt; having a &lt;b&gt;collar&lt;/b&gt;.', '襟', '', 11, '2010-09-18 10:21:18', '2010-09-29 03:30:00', 11, 11),
(6423, 1, 816, 'Every &lt;i&gt;house&lt;/i&gt; in Japan has an &lt;i&gt;altar&lt;/i&gt; in it for the purpose of expressing ones &lt;b&gt;religion&lt;/b&gt;.', '宗', '', 11, '2010-09-18 10:20:33', '2010-09-29 03:30:00', 11, 11),
(6424, 1, 816, 'Shintoism is a &lt;i&gt;religion&lt;/i&gt; which gives &lt;i&gt;mountains&lt;/i&gt; a great amount of &lt;b&gt;adoration&lt;/b&gt;.', '崇', '', 10, '2010-09-23 05:55:06', '2010-10-03 03:30:00', 16, 15),
(6425, 1, 816, '&lt;i&gt;Flesh&lt;/i&gt; is cut from the &lt;i&gt;crotch&lt;/i&gt; on top of an &lt;i&gt;altar&lt;/i&gt; as apart of a satanic &lt;b&gt;ritual&lt;/b&gt;.', '祭', '', 11, '2010-09-18 10:21:54', '2010-09-29 03:30:00', 11, 11),
(6426, 1, 816, 'A DIY &lt;i&gt;ritual&lt;/i&gt; performed at &lt;i&gt;home&lt;/i&gt; incorporates a lot of &lt;b&gt;guess&lt;/b&gt;-work.', '察', '', 11, '2010-09-18 10:23:15', '2010-09-29 03:30:00', 11, 11),
(6427, 1, 816, 'The kanji for &lt;b&gt;grate&lt;/b&gt; comrpises of the elements &lt;i&gt;fingers&lt;/i&gt; and &lt;i&gt;guess&lt;/i&gt;.', '擦', '', 10, '2010-09-18 10:22:46', '2010-09-28 03:30:00', 15, 14),
(6428, 1, 816, 'The &lt;b&gt;wherefore&lt;/b&lt; of this kanji explains the reasion or origin of a thing.  It does this graphically by depicting a seed in a &lt;i&gt;ricefield&lt;/i&gt; sedning up a single sprout, which is the whole why and &lt;b&gt;wherefore&lt;/b&gt; of the seed&#039;s falling in the earth and dying.', '由', '', 11, '2010-09-18 10:22:13', '2010-09-29 03:30:00', 11, 11),
(6429, 1, 816, 'The &lt;i&gt;sprouting&lt;/i&gt; rice shoots are &lt;b&gt;plucked&lt;/b&gt; out of their paddies by eager &lt;i&gt;fingers&lt;/i&gt;, and transplanted to another, better paddy, to be &lt;b&gt;plucked&lt;/b&gt; out again later.', '抽', '', 11, '2010-09-18 10:21:01', '2010-09-29 03:30:00', 11, 11),
(6430, 1, 816, 'Black &lt;i&gt;water sprouting&lt;/i&gt; out of the ground is a sure sign of &lt;b&gt;oil&lt;/b&gt; in the back garden.', '油', '', 11, '2010-09-18 10:21:30', '2010-09-29 03:30:00', 11, 11),
(6431, 1, 816, 'That which &lt;i&gt;sprouts&lt;/i&gt; from a &lt;i&gt;cloak&lt;/i&gt; we call the &lt;b&gt;sleeve&lt;/b&gt;.', '袖', '', 11, '2010-09-18 10:22:24', '2010-09-29 03:30:00', 11, 11),
(6432, 1, 816, 'A more expensive type of clay-pigeon shooting, involved &lt;i&gt;shooting&lt;/i&gt; a &lt;i&gt;house&lt;/i&gt; &lt;b&gt;mid-air&lt;/b&gt;.', '宙', '', 11, '2010-09-18 10:21:40', '2010-09-29 03:30:00', 11, 11),
(6433, 1, 816, 'A brand new &lt;b&gt;delivery&lt;/b&gt; system has been invented where packages &lt;i&gt;shoot&lt;/i&gt; from one &lt;i&gt;flag&lt;/i&gt;-point to another, ready for collection, miles away.', '届', '', 11, '2010-09-18 10:22:33', '2010-09-29 03:30:00', 11, 11),
(6434, 1, 816, 'A &lt;i&gt;sprout&lt;/i&gt; of innovationg combined with some bits of &lt;i&gt;bamboo&lt;/i&gt; resulted in the invention of the &lt;b&gt;flute&lt;/b&gt;.', '笛', '', 11, '2010-09-18 10:20:46', '2010-09-29 03:30:00', 11, 11),
(6435, 1, 816, 'The aerodynamics of a &lt;i&gt;car&lt;/i&gt; are such that if you &lt;i&gt;shoot&lt;/i&gt; one, then it will turn on its &lt;b&gt;axis&lt;/b&gt;.', '軸', '', 11, '2010-09-19 09:26:53', '2010-09-30 03:30:00', 11, 11),
(6436, 1, 816, 'This kanji is a pictograph of a piece of breast-plate &lt;b&gt;armour&lt;/b&gt;.', '甲', '', 8, '2010-09-20 05:25:56', '2010-09-28 03:30:00', 16, 15),
(6437, 1, 816, 'When planting, seedlings are taken by the &lt;i&gt;fingers&lt;/i&gt; and the &lt;i&gt;roots&lt;/i&gt; are &lt;b&gt;pushed&lt;/b&gt; into the ground.', '押', '', 11, '2010-09-19 09:29:42', '2010-09-30 03:30:00', 11, 11),
(6438, 1, 816, 'It could be considered that the &lt;i&gt;mountain&#039;s roots&lt;/i&gt; is the &lt;b&gt;headland&lt;/b&gt;.', '岬', '', 11, '2010-09-25 11:21:22', '2010-10-06 03:30:00', 15, 14),
(6439, 1, 816, 'Magazine &lt;b&gt;inserts&lt;/b&gt; are &lt;b&gt;inserted&lt;/b&lt; by hand.  Pick up one with your &lt;i&gt;fingers&lt;/i&gt; and push it into the &lt;i&gt;roots&lt;/i&gt; of the magazine.  Do this a &lt;i&gt;thousand&lt;/i&gt; times for that many &lt;b&gt;inserts&lt;/b&gt;.', '挿', '', 8, '2010-09-19 09:27:49', '2010-09-27 03:30:00', 19, 17),
(6440, 1, 816, 'Here we see a &lt;i&gt;wagging tongue&lt;/i&gt; silenced by a &lt;i&gt;walking stick&lt;/i&gt;, because another has the desire to &lt;i&gt;speaketh&lt;/i&gt;.', '申', '', 11, '2010-09-19 09:28:03', '2010-09-30 03:30:00', 11, 11),
(6441, 1, 816, 'A &lt;i&gt;person&lt;/i&gt; is a simply a &lt;i&gt;monkey&lt;/i&gt; &lt;b&gt;expanded&lt;/b&gt;.', '伸', '', 11, '2010-09-19 09:25:30', '2010-09-30 03:30:00', 11, 11),
(6442, 1, 816, 'A &lt;i&gt;monkey&lt;/i&gt; statue near an &lt;i&gt;altar&lt;/i&gt; is a sure sign of some very well-looked-after &lt;b&gt;gods&lt;/b&gt;.', '神', '', 11, '2010-09-25 11:21:13', '2010-10-06 03:30:00', 15, 14),
(6443, 1, 816, '&lt;i&gt;Fingers&lt;/i&gt; creeping across a &lt;i&gt;monkey crotch&lt;/i&gt; can only mean another ape is &lt;b&gt;searching&lt;/b&gt; for flees.', '捜', '', 10, '2010-09-18 10:23:00', '2010-09-28 03:30:00', 17, 15),
(6444, 1, 816, 'The final stage of the seed is reached when the plant has reached its full growth (the &lt;i&gt;tree&lt;/i&gt;), and comes to fruition, producing &lt;b&gt;fruit&lt;/b&gt; full of new seeds that can return to the earth and start the process all over again.  The main thing to notice here is the element for &lt;i&gt;brains&lt;/i&gt; at the top, which might prove more helpful than &lt;i&gt;ricefield&lt;/i&gt; for creating the image.', '果', '', 11, '2010-09-19 09:30:31', '2010-09-30 03:30:00', 11, 11),
(6445, 1, 816, '&lt;i&gt;Flowers&lt;/i&gt; and &lt;i&gt;fruits&lt;/i&gt; are nature&#039;s &lt;b&gt;candy&lt;/b&gt;.', '菓', '', 11, '2010-09-19 09:28:31', '2010-09-30 03:30:00', 11, 11),
(6446, 1, 816, 'The number of &lt;i&gt;words&lt;/i&gt; it takes to read whilst eating a piece of &lt;i&gt;fruit&lt;/i&gt; is approx. one &lt;b&gt;chapter&lt;/b&gt;.', '課', '', 11, '2010-09-19 09:24:21', '2010-09-30 03:30:00', 11, 11),
(6447, 1, 816, 'Adam and Eve put a &lt;i&gt;cloak&lt;/i&gt; on themselves after eating the forbidden &lt;i&gt;fruit&lt;/i&gt; from the tree of knowledge.  Before that, they were &lt;b&gt;naked&lt;/b&gt;.', '裸', '', 11, '2010-09-19 09:28:20', '2010-09-30 03:30:00', 11, 11),
